(1, '5c9c1ff62ce0c3.78174962', 1, 'Tijeras de cocina ', 'tijeras-de-cocina', 'Tijeras de cocina multiusos con abre nueces integrado. ', '<ul>\r\n	<li>﻿﻿Tijeras de acero inoxidable de 20 cent&iacute;metros de excelente calidad.</li>\r\n	<li>Muy resistentes y de larga duraci&oacute;n.&nbsp;</li>\r\n	<li>Cuentan con un abre nueces y un abridor de botellas o tarros.</li>\r\n	<li>Son aptas para ser lavadas en lavavajillas.&nbsp;</li>\r\n	<li>Ser&aacute;n las &uacute;ltimas tijeras que compres.&nbsp;</li>\r\n</ul>\r\n', '', 'Otro', 'no', '', '', '', '', '', '', '105.00', '0.00', 'MXN', 'no', 2, 1, 1, 'No disponible para la venta', '2019-07-13 23:29:10', '2019-07-13 23:29:10', '2019-07-13 23:29:10', '12.00', '18.00', '2.00', '0.20', 'normal', 'nuevo', 0, '0.00', 'es', 'activo', 1),
(2, '5c9c1ff62ce0c3.78174962', 1, 'Juego de tijeras para cocina.', 'juego-de-tijeras-para-cocina', 'Versátiles tijeras para la cocina, la oficina y el hogar. Con mangos recubiertos para mejor agarre y máxima seguridad. ', '<ul>\r\n	<li>Este juego de tijeras es uno de los favoritos en el mercado.</li>\r\n	<li>Su suave recubrimiento en el mango permite un mejor control y m&aacute;xima sujeci&oacute;n al momento de cortar.</li>\r\n	<li>Su cuerpo de acero inoxidable lo hace muy resistente y de larga duraci&oacute;n.</li>\r\n	<li>El set incluye 1 par de tijeras de 21.6 cm y 2 pares de 13 cm para cortar, papel, cart&oacute;n, tela, y carne o usos en la cocina</li>\r\n	<li>Garant&iacute;a de fabricaci&oacute;n de por vida.</li>\r\n	<li>Mant&eacute;ngase alejado de ni&ntilde;os ya que las navajas se mantienen afiladas por m&aacute;s de 100,000 cortes\r\n	<p>&nbsp;</p>\r\n	</li>\r\n</ul>\r\n', '', 'Otro', 'no', '', '', '', '', '', '', '139.00', '0.00', 'MXN', 'no', 2, 1, 1, 'No disponible para la venta', '2019-07-13 23:27:04', '2019-07-13 23:27:04', '2019-07-13 23:27:04', '12.70', '12.70', '20.30', '0.20', 'normal', 'nuevo', 0, '0.00', 'es', 'activo', 1),
(3, '5c9c1ff62ce0c3.78174962', 1, 'Pinzas de acero inoxidable para alimentos. ', 'pinzas-para-alimentos', 'Pinza para alimentos con puntas de silicon grado alimenticio. Excelentes para el manejo de alimentos calientes o para servir las ensaladas.  ', '<ul>\r\n	<li>Pinzas de acero inoxidable con puntas de silicon altamente resistente&nbsp;al calor.&nbsp;</li>\r\n	<li>El arillo en la parte superior sirve como seguro, al jalarlo las pinzas se cierran y no se vuelven a abrir.</li>\r\n	<li>F&aacute;ciles de almacenar sin&nbsp;nada de complicaciones al sacarlas del caj&oacute;n.&nbsp;</li>\r\n	<li>Sus costados est&aacute;n&nbsp;recubiertos con silicon lo que le da un excelente agarre.&nbsp;</li>\r\n	<li>Sus caracter&iacute;sticas&nbsp;las hacen un utensilio&nbsp;sobresaliente en la cocina, para mezclar ensaladas, voltear carnes y transferir pasta o vegetales.&nbsp;</li>\r\n	<li>Miden 28 cm de largo.&nbsp;</li>\r\n</ul>\r\n\r\n<p>&nbsp;</p>\r\n', '', 'Otro', 'no', '', '', '', '', '', '', '107.00', '0.00', 'MXN', 'no', 34, 1, 1, 'No disponible para la venta', '2019-07-13 23:22:28', '2019-07-15 21:23:15', '2019-07-13 23:22:28', '4.00', '4.00', '27.50', '0.25', 'normal', 'nuevo', 0, '0.00', 'es', 'activo', 1),
(4, '5c9c1ff62ce0c3.78174962', 1, 'Reloj para caballero  Mitaki-Japan®', 'reloj-para-caballero', 'Reloj deportivo digital para hombre marca Mitaki-Japan®', '<ul>\r\n	<li>\r\n	<h3>Excelente reloj para usarlo cuando haces ejercicio o en un d&iacute;a informal.</h3>\r\n	</li>\r\n	<li>\r\n	<h3>Sus caracter&iacute;sticas principales incluyen funci&oacute;n de fecha, alarma, se ilumina al marcarse la hora y luz.</h3>\r\n	</li>\r\n	<li>\r\n	<h3>Su resistente banda de poliuretano es hipoalerg&eacute;nica y de alta resistencia.&nbsp;</h3>\r\n	</li>\r\n	<li>\r\n	<h3>Un bonito regalo para un hombre activo.&nbsp;</h3>\r\n	</li>\r\n</ul>\r\n', '', 'Otro', 'no', '', '', '', '', '', '', '279.00', '0.00', 'MXN', 'no', 2, 1, 1, 'No disponible para la venta', '2019-07-13 23:26:21', '2019-07-13 23:26:21', '2019-07-13 23:26:21', '2.00', '5.00', '181.00', '0.19', 'normal', 'nuevo', 0, '0.00', 'es', 'activo', 1),
(5, '5c9c1ff62ce0c3.78174962', 1, 'Reloj digital deportivo para caballero marca Mitaki-Japan® modelo Super.', 'reloj-para-caballero-rcx', 'Practico y resistente reloj digital para caballero de la marca Mitaki-Japan®', '<ul>\r\n	<li><strong>Este excelente reloj cuenta con funciones de luz, cronometro y fecha.</strong></li>\r\n	<li><strong>Resistente al agua hasta los 30 metros. </strong></li>\r\n	<li><strong>Tu compa&ntilde;ero ideal para hacer ejercicio todos los d&iacute;as. </strong></li>\r\n	<li><strong>Muy liviano y resistente.&nbsp;</strong></li>\r\n</ul>\r\n', '', 'Otro', 'no', '', '', '', '', '', '', '179.00', '680.00', 'MXN', 'no', 1, 1, 1, 'No disponible para la venta', '2019-07-13 23:25:59', '2019-07-13 23:25:59', '2019-07-13 23:25:59', '5.00', '2.00', '18.00', '0.21', 'normal', 'nuevo', 0, '0.00', 'es', 'activo', 1),
(6, '5c9c1ff62ce0c3.78174962', 1, 'Reloj para dama  Mitaki-Japan® Ladies\' Digital Sport Watch', 'reloj-para-dama', 'Practico y cómodo reloj deportivo digital de la marca Mitaki-Japan®. Utilízalo para ir al gimnasio, a correr e incluso a nadar ya que es resistente al agua. ', '<ul>\r\n	<li>Este excelente reloj incluye funciones de fecha, luz y alarma.</li>\r\n	<li>Dise&ntilde;o muy femenino.&nbsp;</li>\r\n	<li>Ideal para ir a correr, al gimnasio o para practicar tu deporte favorito.&nbsp;</li>\r\n	<li>Es resistente al agua hasta los 30 metros de profundidad.</li>\r\n</ul>\r\n', '', 'Otro', 'no', '', '', '', '', '', '', '179.00', '0.00', 'MXN', 'no', 2, 1, 1, 'No disponible para la venta', '2019-07-13 23:25:22', '2019-07-13 23:25:22', '2019-07-13 23:25:22', '1.00', '5.00', '18.00', '0.25', 'normal', 'nuevo', 0, '0.00', 'es', 'activo', 1),
(7, '5c9c1ff62ce0c3.78174962', 1, 'Vaso termo ', 'vaso-termo', 'Vaso térmico de doble pared y tapa transparente para que tu bebida viaje contigo a cualquier lado. ', '<ul>\r\n	<li>Vaso de acero inoxidable con doble capa de aislamiento que permite mantener las bebidas calientes o fr&iacute;as por 6 horas sin importar el clima exterior.&nbsp;</li>\r\n	<li>No transfiere olores o sabores a la bebida.&nbsp;</li>\r\n	<li>Su tapa transparente permite ver a trav&eacute;s de ella sin tener que abrir el vaso.</li>\r\n	<li>Tapa a prueba de fugas y derrames.&nbsp;</li>\r\n	<li>Capacidad de 473 mililitros.</li>\r\n</ul>\r\n\r\n<p>&nbsp;</p>\r\n', '', 'Otro', 'no', '', '', '', '', '', '', '280.00', '0.00', 'MXN', 'no', 2, 1, 1, 'No disponible para la venta', '2019-07-13 23:34:17', '2019-07-13 23:34:17', '2019-07-13 23:34:17', '7.00', '18.50', '0.00', '0.50', 'normal', 'nuevo', 0, '0.00', 'es', 'activo', 1),
(8, '5c9c1ff62ce0c3.78174962', 1, 'Botella de vidrio con proteccion ', 'botella-de-vidrio-con-proteccion', 'Botella de vidrio de 473 mililitros  con cubierta de silicon y tapa abatible.', '<ul>\r\n	<li>Botella de vidrio 100% reciclable, para ti que buscas reducir tu consumo de pl&aacute;sticos.</li>\r\n	<li>Sin qu&iacute;micos ni sustancias que liberen sabores y olores desagradables a las bebidas.&nbsp;</li>\r\n	<li>La tapa tiene un empaque de silicon a prueba de fugas y derrames.&nbsp;</li>\r\n	<li>Su recubrimiento de silicon lo hace m&aacute;s seguro al agarre y m&aacute;s resistente contra el impacto en caso de ca&iacute;das.&nbsp;</li>\r\n	<li>F&aacute;cil de lavar. NO apta para lavavajillas.&nbsp;</li>\r\n	<li>Capacidad de 532&nbsp;mililitros, 18 oz.&nbsp;</li>\r\n</ul>\r\n\r\n<p>&nbsp;</p>\r\n', '', 'Otro', 'no', '', '', '', '', '', '', '299.00', '0.00', 'MXN', 'no', 1, 1, 1, 'No disponible para la venta', '2019-07-13 23:30:06', '2019-07-13 23:30:06', '2019-07-13 23:30:06', '0.00', '0.00', '0.00', '0.63', 'normal', 'nuevo', 0, '0.00', 'es', 'activo', 1),
(9, '5c9c1ff62ce0c3.78174962', 1, 'Termo con recubrimiento para máximo agarre', 'termo-con-recubrimiento-de-agarre', 'Practico termo de doble pared ideal para trasladar tus líquidos sin derrames. ', '<ul>\r\n	<li>Esta botella de doble pared mantiene tus bebidas favoritas calientes o fr&iacute;as durante horas.</li>\r\n	<li>Con su envoltura de silic&oacute;n es muy f&aacute;cil de sujetarla, mientras que su tapa abre f&aacute;cil permite que abrirla y cerrarla sea pan comido.</li>\r\n	<li>El vaso esta totalmente hecho de acero inoxidable 18/8 lo que lo hace altamente resistente a la corrosi&oacute;n y f&aacute;cil de limpiar.</li>\r\n	<li>No tendr&aacute;s que preocuparte por olores desagradables o sabores que queden impregnados.</li>\r\n	<li>Olv&iacute;date de las botellas de pl&aacute;stico.&nbsp;</li>\r\n	<li>Capacidad de 532 mililitros, 18 oz.&nbsp;</li>\r\n</ul>\r\n\r\n<pre>\r\n\r\n&nbsp;</pre>\r\n', '', 'Otro', 'no', '', '', '', '', '', '', '279.00', '0.00', 'MXN', 'no', 2, 1, 1, 'No disponible para la venta', '2019-07-13 23:32:40', '2019-07-13 23:32:40', '2019-07-13 23:32:40', '7.00', '22.00', '0.00', '0.50', 'normal', 'nuevo', 0, '0.00', 'es', 'activo', 1),
(13, '5c9c1ff62ce0c3.78174962', 1, 'Infusor para te en forma de fresa', 'infusor-para-te-en-forma-de-fresa', 'Lindo infusor para preparar té de hoja suelta en forma de fresa ', '<ul>\r\n	<li>Ligero, durable, f&aacute;cil de usar y lavar.</li>\r\n	<li>Es el regalo ideal para los amantes del te.&nbsp;</li>\r\n	<li>Con un lindo dise&ntilde;o en forma de fresa que puedas rellenar totalmente para disfrutar la concentraci&oacute;n perfecta de tu t&eacute;.&nbsp;</li>\r\n	<li>Fabricado con silicon grado alimenticio, este infusor resulta muy seguro para su uso ya que el material es totalmente adecuado para su uso en alimentos.</li>\r\n	<li>No desprender&aacute; sabores en el agua y es muy f&aacute;cil de lavar.</li>\r\n	<li>M&aacute;s f&aacute;cil de lavar que un infusor met&aacute;lico.</li>\r\n	<li>Es un adecuado compa&ntilde;ero en las largas horas laborales o en los viajes de fin de semana.&nbsp;</li>\r\n</ul>\r\n', '', 'Otro', 'no', '', '', '', '', '', '', '73.00', '0.00', 'MXN', 'no', 18, 1, 1, 'No disponible para la venta', '2019-07-15 19:00:09', '2019-07-15 19:00:09', '2019-07-15 19:00:09', '5.00', '6.00', '2.00', '0.04', 'normal', 'nuevo', 0, '0.00', 'es', 'activo', 1),
(14, '5c9c1ff62ce0c3.78174962', 1, 'Infusor de té en forma de T-Rex', 'infusor-de-té-en-forma-de-t-rex', 'Infusiona tus hierbas de forma divertida con este lindo dinosaurio. ', '<ul>\r\n	<li>Fabricado con silic&oacute;n grado alimenticio, este verde amigo es una opci&oacute;n refrescante para preparar tu t&eacute; todos los d&iacute;as.</li>\r\n	<li>Puedes llenar el cuerpo y la cabeza para obtener la concentraci&oacute;n que m&aacute;s te gusta.</li>\r\n	<li>Resistente, durable y f&aacute;cil de lavar.&nbsp;</li>\r\n	<li>Ponle una nueva cara a tus ma&ntilde;anas y rel&aacute;jate tomando tu t&eacute; matinal.</li>\r\n</ul>\r\n', '', 'Otro', 'no', '', '', '', '', '', '', '112.00', '0.00', 'MXN', 'no', 25, 1, 1, 'No disponible para la venta', '2019-07-15 19:04:37', '2019-07-15 19:04:37', '2019-07-15 19:04:37', '4.00', '7.00', '4.00', '0.06', 'normal', 'nuevo', 0, '0.00', 'es', 'activo', 1),
(15, '5c9c1ff62ce0c3.78174962', 1, 'Divertidos marcadores para copas de emojis', 'marcadores-para-vaso-o-copas-de-emojis', 'Set de 8  marcadores para copas de emojis. ', '<ul>\r\n	<li>Divertidos&nbsp;emojis para marcar tus copas durante tus fiestas.</li>\r\n	<li>No correr&aacute;s m&aacute;s el riesgo de que alguien se tome tu bebida, solo marca tu copa y disfruta de la fiesta.&nbsp;</li>\r\n	<li>Ocho diferentes dise&ntilde;os, ligeros, y se adhiere a botellas, vasos y copas de vidrio.</li>\r\n	<li>F&aacute;ciles de usar y lavar.&nbsp;&nbsp;</li>\r\n</ul>\r\n', '', 'Otro', 'no', '', '', '', '', '', '', '164.00', '0.00', 'MXN', 'no', 25, 1, 1, 'No disponible para la venta', '2019-07-13 23:18:37', '2019-07-13 23:18:37', '2019-07-13 23:18:37', '3.00', '2.00', '2.00', '0.07', 'normal', 'nuevo', 0, '0.00', 'es', 'activo', 1),
(21, '5c9c1ff62ce0c3.78174962', 1, 'Joyero de madera hecho a mano', 'joyero-de-madera-hecho-a-mano', 'Hermosa joyero de madera hecho a mano con cerradura totalmente funcional.', '<ul>\r\n	<li>﻿﻿Esta linda caja de madera esta totalmente hecha a mano en madera de pino por un artesano veracruzano.</li>\r\n	<li>El trabajo se encuentra perfectamente detallado y los acabados muy bien cuidados.</li>\r\n	<li>La cerradura es de primera calidad y es totalmente funcional.</li>\r\n	<li>Incluye dos llaves.&nbsp;</li>\r\n	<li>Gracias a su terminado natural es posible decorarlo o pintarlo al gusto de la persona.</li>\r\n	<li>Deje que sus ni&ntilde;as lo personalicen y creen un lugar privado en donde guardar sus secretos.&nbsp;</li>\r\n</ul>\r\n\r\n<p>&nbsp;</p>\r\n', '', 'México', 'si', '', '', '', '', '', '', '160.00', '240.00', 'MXN', 'no', 10, 1, 1, 'No disponible para la venta', '2019-07-13 23:59:35', '2019-07-13 23:59:35', '2019-07-13 23:59:35', '17.50', '13.00', '18.00', '1.06', 'normal', 'nuevo', 0, '0.00', 'es', 'activo', 1),
(22, '5c9c1ff62ce0c3.78174962', 1, 'Set de 6 piezas de tapas de silicón elásticas que se adaptan a cualquier contenedor de 6.5 a 20 cm. ', 'tapas-de-silicón', 'Prácticas y resistentes tapas de silicón, grado alimenticio, para conservar tus alimentos por mayor tiempo en el refrigerador. Set de 6 piezas de 20 cm, 17 cm, 15 cm, 12 cm, 10 cm y  6.5 cm. ', '<ul>\r\n	<li>Set de 6 piezas de tapas el&aacute;sticas de silicon grado alimenticio, aprobado por la FDA.</li>\r\n	<li>Totalmente seguro para uso con alimentos ya que es un material inocuo que no libera ning&uacute;n tipo de gas, olor o residuo. Libres de BPA, plomo.</li>\r\n	<li>Resistentes a altas temperaturas.</li>\r\n	<li>Totalmente reutilisables.&nbsp;</li>\r\n	<li>Las tapas miden 20 cm, 17 cm, 15 cm, 12 cm, 10 cm y 6.5 cm de di&aacute;metro.</li>\r\n	<li>Ideales para cubrir cualquier recipiente.&nbsp;</li>\r\n	<li>Sellan herm&eacute;ticamente lo que hace imposible que haya un derrame accidental.&nbsp;</li>\r\n	<li>Puedes usarlas para cubrir tus alimentos si estas en un d&iacute;a de campo o mientras viajas.&nbsp;</li>\r\n	<li>Pueden usarse para cubrir frutas y verduras directamente ya que son muy manejables y suaves.&nbsp;</li>\r\n	<li>Mantienen los alimentos frescos dentro y fuera del refrigerador.&nbsp;</li>\r\n	<li>F&aacute;cil de usar y lavar.&nbsp;</li>\r\n	<li>Vienen en tres diferentes grados de resistencia, para que todos en la familia puedan usarlas f&aacute;cilmente.&nbsp;</li>\r\n	<li>La calidad del producto esta relacionada con su peso en gramos. A mayor cantidad de gramos mayor calidad, resistencia&nbsp;y durabilidad.&nbsp;</li>\r\n	<li>No tienes que preocuparte por comprar un sin numero de tapas, gracias a su elasticidad puedes usarlas sobre pr&aacute;cticamente cualquier olla, sart&eacute;n o refractario.&nbsp;</li>\r\n</ul>\r\n', '', 'Otro', 'no', '', '', '', '', '', '', '144.00', '170.00', 'MXN', 'no', 47, 1, 1, 'No disponible para la venta', '2019-07-13 23:07:52', '2019-07-13 23:07:52', '2019-07-13 23:07:52', '19.00', '3.00', '3.00', '0.38', 'normal', 'nuevo', 0, '0.00', 'es', 'activo', 1),
(24, '5c9c1ff62ce0c3.78174962', 1, 'Cartucho de carbon activado para filtros encima del fregadero', 'cartucho-de-fibra-de-coco', 'Cartucho de fibra de coco para filtros sobre el fregadero.', '<ul>\r\n	<li>Cartucho de carb&oacute;n activado fabricado 100% con fibra de coco, uno de los mejores materiales para purificaci&oacute;n de agua.&nbsp;</li>\r\n	<li>Entrada universal para cualquier filtro que vaya encima del fregadero.&nbsp;</li>\r\n	<li>Con capacidad de filtraci&oacute;n hasta por 6 meses.&nbsp;</li>\r\n	<li>Excelente calidad.&nbsp;</li>\r\n</ul>\r\n', '', 'Otro', 'no', '', '', '', '', '', '', '500.00', '0.00', 'MXN', 'no', 99, 1, 1, 'No disponible para la venta', '2019-07-13 23:39:38', '2019-07-13 23:39:38', '2019-07-13 23:39:38', '7.00', '25.00', '10.50', '0.40', 'normal', 'nuevo', 0, '0.00', 'es', 'activo', 1),
(25, '5c9c1ff62ce0c3.78174962', 1, 'Cartucho de carbón activado para filtros sobre y bajo el fregadero', 'cartucho-royal', 'Cartucho para filtros sobre y debajo del fregadero. ', '<p>Repuesto de cartucho para filtro sobre y debajo del fregadero. Ideal para los filtros Eclipse y Royal. Cuerpo de carbon activado de la mejor calidad.&nbsp;</p>\r\n', '', 'Otro', 'no', '', '', '', '', '', '', '100.00', '0.00', 'USD', 'no', 49, 1, 1, 'No disponible para la venta', '2019-06-03 21:52:32', '2019-06-04 15:56:12', '2019-06-03 21:52:32', '12.00', '20.00', '1.00', '1.00', 'normal', 'nuevo', 0, '0.00', 'es', 'inactivo', 1),
(26, '5c9c1ff62ce0c3.78174962', 1, 'Manguera con válvula para filtro sobre el fregadero', 'manguera-con-válvula-para-filtro-sobre-el-fregadero', 'Válvula y manguera para filtro encima del fregadero. ', '<p>V&aacute;lvula y manguera de respuesto para los filtros de agua instalados arriba del fregadero. La v&aacute;lvula est&aacute; fabricada en acero inoxidable y la manguera es de alta calidad, con un metro de longitud para facilitar el acomodo del filtro en cualquier area del fregadero.&nbsp;</p>\r\n', '', 'Otro', 'no', '', '', '', '', '', '', '35.00', '0.00', 'USD', 'no', 1, 1, 1, 'No disponible para la venta', '2019-07-05 17:50:11', '2019-07-05 17:50:11', '2019-07-05 17:50:11', '0.00', '0.00', '0.00', '0.50', 'normal', 'nuevo', 0, '0.00', 'es', 'inactivo', 1),
(27, '5c9c1ff62ce0c3.78174962', 1, 'Set de 4 tazas para medir alimentos marca Chef\'s Secret® en acero inoxidable', 'chefs-secret-4pc-t304-stainless-steel-measuring-cup-set', 'Set de 4 tazas para medición de la marca Chef\'s Secret® en acero inoxidable. ', '<ul>\r\n	<li>&Uacute;til y pr&aacute;ctico set de 4 tazas para medici&oacute;n de alimentos.</li>\r\n	<li>No vuelvas a adivinar si estas usando la cantidad correcta de tus ingredientes al preparar tus recetas favoritas. Con estas tazas medidoras tendr&aacute;s el control total para preparar esos exquisitos platillos que a tu familia les encantan.&nbsp;</li>\r\n	<li>Este set viene con un anillo para mantener las tazas juntas.</li>\r\n	<li>Los mangos&nbsp;est&aacute;n soldados al cuerpo de la taza por lo que no existe riesgo que se desprendan.</li>\r\n	<li>La capacidad de cada taza, 1 taza, 1/2 taza, 1/3 taza y 1/4 taza.</li>\r\n	<li>El exterior presenta un acabado espejo mientras que el interior es satinado.</li>\r\n	<li>Tenemos dos modelos:\r\n	<ul>\r\n		<li>Mango liso con la cantidad grabada&nbsp;en el mango, claramente visible.&nbsp;</li>\r\n		<li>Mango tubular con la cantidad grabada en el costado de la taza.&nbsp;</li>\r\n	</ul>\r\n	</li>\r\n</ul>\r\n', '', 'Otro', 'no', '', '', '', '', '', '', '379.00', '420.00', 'MXN', 'no', 1, 1, 1, 'No disponible para la venta', '2019-07-13 23:38:14', '2019-07-13 23:38:14', '2019-07-13 23:38:14', '6.00', '6.00', '15.00', '0.38', 'normal', 'nuevo', 0, '0.00', 'es', 'activo', 1),
(28, '5c9c1ff62ce0c3.78174962', 1, 'Divertidas moldes para hotcakes o huevo', 'divertidas-moldes-para-hotcakes-o-huevo', 'Prepara hotcakes en forma de conejo, buho o un radiante sol con estos moldes de silicon grado alimenticio. ', '<ul>\r\n	<li>Empieza tu d&iacute;a&nbsp;con un desayuno divertido y nutritivo.</li>\r\n	<li>Crea hotcakes&nbsp;o huevos con diferentes temas y figuras.&nbsp;</li>\r\n	<li>Moldes hechos de silicon resistente al calor, f&aacute;cil de usar y de lavar. Completamente&nbsp;seguros para utilizarlos con alimentos.&nbsp;</li>\r\n	<li>Contiene 3 moldes,&nbsp;&nbsp;sol con nube, conejo y b&uacute;ho.</li>\r\n	<li>Regala un rato de diversi&oacute;n a tus peque&ntilde;os o consciente con un lindo detalle a esa persona especial.&nbsp;</li>\r\n</ul>\r\n\r\n<p><br />\r\n<br />\r\n&nbsp;</p>\r\n', '', 'Otro', 'no', '', '', '', '', '', '', '106.00', '0.00', 'MXN', 'no', 31, 1, 1, 'No disponible para la venta', '2019-07-15 19:02:21', '2019-07-15 19:02:21', '2019-07-15 19:02:21', '10.00', '11.00', '1.50', '0.38', 'normal', 'nuevo', 0, '0.00', 'es', 'activo', 1),
(29, '5c9c1ff62ce0c3.78174962', 1, 'Juego de espátula para mezcla y 12 capacillos para hornear ', 'espatula-para-mezcla-y-capacetes-para-hornear', 'Juego de espátula para mezcla de 21 cm y 12 capacillos para hornear en llamativos colores.', '<ul>\r\n	<li>Esp&aacute;tula, mejor conocida como pala miserable, y moldes hechos de silicon de alta calidad excelentes para hornear.&nbsp;</li>\r\n	<li>Los moldes son reusables lo que te evita generar mas basura y reforzar tu consciencia ecol&oacute;gica.</li>\r\n	<li>Miden aproximadamente 6.5 cm de di&aacute;metro por 3 cm de alto.&nbsp;</li>\r\n	<li>Una gran alternativa para hornear sin tener que utilizar moldes de papel.</li>\r\n	<li>Ideales para panques, gelatinas, mousse, helado, chocolates o chesse cakes.&nbsp;</li>\r\n	<li>F&aacute;ciles de desmoldar y de limpiar.&nbsp;</li>\r\n	<li>Incluye una esp&aacute;tula de 21.5 cm de largo fabricada con silicon grado alimenticio.&nbsp;</li>\r\n	<li>Este juego es el regalo perfecto para los amantes de los postres.&nbsp;</li>\r\n</ul>\r\n\r\n<p>&nbsp;</p>\r\n', '', 'Otro', 'no', '', '', '', '', '', '', '118.00', '0.00', 'MXN', 'no', 35, 1, 1, 'No disponible para la venta', '2019-07-14 00:08:02', '2019-07-14 00:08:02', '2019-07-14 00:08:02', '0.00', '0.00', '0.00', '0.38', 'normal', 'nuevo', 0, '0.00', 'es', 'activo', 1),
(30, '5c9c1ff62ce0c3.78174962', 1, 'Set de esponja de silicón y embudo plegable', 'esponja-de-silicona-para-trastos-y-embudo-plegable', 'Set de esponja de silicón de 11 cm de diámetro y embudo cuadrado plegable de 7.5 cm. ', '<ul>\r\n	<li>﻿﻿&nbsp;Esponja multifuncional&nbsp;de 11 cent&iacute;metros para lavar platos y utensilios&nbsp;de cocina.&nbsp;</li>\r\n	<li>Ideal para jarras de vidrio, vasos, art&iacute;culos delicados&nbsp;y sartenes recubiertas.&nbsp;</li>\r\n	<li>Hecho de silicon aprobado para usarse con alimentos. No es poroso lo que previene malos olores y crecimiento de bacterias.&nbsp;</li>\r\n	<li>Suave, no deja marcas.&nbsp;</li>\r\n	<li>Es&nbsp;muy flexible, lo que permite&nbsp;alcanzar espacios reducidos como esquinas de moldes, vasos y copas.</li>\r\n	<li>Art&iacute;culo 100% garantizado.&nbsp;</li>\r\n	<li>El embudo plegable de 7.5 cm de di&aacute;metro.&nbsp;</li>\r\n	<li>Evita esas luchas contra el caj&oacute;n. Ocupa un espacio peque&ntilde;o y jam&aacute;s se atorar&aacute; al intentar sacarlo del caj&oacute;n.&nbsp;</li>\r\n	<li>Es ideal para transferir l&iacute;quidos y/o s&oacute;lidos como harinas y az&uacute;car. Totalmente seguro para utilizarlo con alimentos y bebidas.&nbsp;</li>\r\n	<li>Colores variados.</li>\r\n	<li>Seguras para lavavajilla.&nbsp;</li>\r\n</ul>\r\n', '', 'Otro', 'no', '', '', '', '', '', '', '100.00', '0.00', 'MXN', 'no', 62, 1, 1, 'No disponible para la venta', '2019-07-14 00:19:06', '2019-07-14 00:19:06', '2019-07-14 00:19:06', '0.00', '0.00', '0.00', '0.12', 'normal', 'nuevo', 0, '0.00', 'es', 'activo', 1),
