(33, '5c9c1ff62ce0c3.78174962', 1, 'Fabuloso recipiente para hacer palomitas en el microondas', 'recipiente-para-hacer-palomitas-en-el-microondas', 'Molde para hacer palomitas en el microondas. ', '<ul>\r\n	<li>Te gustan las palomitas pero te desagrada tener que prepararlas en la estufa?&nbsp;</li>\r\n	<li>Ahora es muy f&aacute;cil hacer palomitas en casa, solo desdobla, agrega&nbsp;cualquier tipo de ma&iacute;z&nbsp;palomero, tu saborizante favorito y listo.</li>\r\n	<li>Coloca el recipiente por 3&nbsp;minutos (dependiendo de tu horno de microondas) en el microondas podr&aacute;s disfrutar de unas ricas y nutritivas palomitas.&nbsp;</li>\r\n	<li>Un excelente regalo para traer el cine a casa y disfrutar de palomitas reci&eacute;n&nbsp;hechas.&nbsp;</li>\r\n	<li>Producto durable y seguro.&nbsp;</li>\r\n	<li>Muy f&aacute;cil de lavar y almacenar.&nbsp;</li>\r\n	<li>Se pliega ocupando menos de la mitad de su tama&ntilde;o.&nbsp;</li>\r\n	<li>&nbsp;</li>\r\n	<li>PRECAUCI&Oacute;N. ESPERA UNOS MINUTOS ANTES DE RETIRAR EL MOLDE DEL HORNO DE MICROONDAS PORQUE QUEDA MUY CALIENTE.&nbsp;</li>\r\n</ul>\r\n', '', 'Otro', 'no', '', '', '', '', '', '', '145.00', '0.00', 'MXN', 'no', 35, 1, 1, 'No disponible para la venta', '2019-07-13 23:18:06', '2019-07-13 23:18:06', '2019-07-13 23:18:06', '20.00', '15.00', '0.00', '0.50', 'normal', 'nuevo', 0, '0.00', 'es', 'activo', 1),
(34, '5c9c1ff62ce0c3.78174962', 1, 'Set de moldes para hielo de Star wars ', 'set-de-moldes-para-hielo-de-star-wars', 'Juego de 8 bandejas de hielo de silicona Star Wars: Stormtrooper, Darth Vader, X-Wing Fighter, Millennium Falcon, R2-D2, Han Solo, Boba Fett, y Death Star', '<ul>\r\n	<li>Moldes fabricados en 100% silicon de alta calidad totalmente aprobada para uso en alimentos.&nbsp;</li>\r\n	<li>Excelentes para usarlos en el congelador para hacer hielos, o en refrigerador para unas divertidas gelatinas.&nbsp;</li>\r\n	<li>Puedes tambi&eacute;n hacer chocolates, caramelos e incluso velas.&nbsp;</li>\r\n	<li>Resistentes al congelador y al calor.&nbsp;</li>\r\n	<li>8 Diferentes colores y figuras.&nbsp;</li>\r\n	<li>Son el regalo perfecto para personas de cualquier edad y un regalo obligado para aquellos amantes de Star Wars.&nbsp;</li>\r\n	<li>Los ni&ntilde;os pasaran un rato muy divertido al realizar sus gelatinas o chocolates con sus figuras favoritas.&nbsp;</li>\r\n</ul>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n', '', 'Otro', 'no', '', '', '', '', '', '', '285.00', '0.00', 'MXN', 'no', 33, 1, 1, 'No disponible para la venta', '2019-07-13 23:56:23', '2019-07-13 23:56:23', '2019-07-13 23:56:23', '20.00', '10.00', '20.00', '1.00', 'normal', 'nuevo', 0, '0.00', 'es', 'activo', 1),
(35, '5c9c1ff62ce0c3.78174962', 1, 'Encantador infusor de té en forma de buzo', 'infusor-de-té-en-forma-de-buzo', 'Práctico infusor en forma de buzo para preparar cualquier te de hoja suelta.', '<ul>\r\n	<li>Este aventurero amigo ser&aacute; tu compa&ntilde;ero fiel cada tarde a la hora del t&eacute;.</li>\r\n	<li>Fabricado con silicon 100% grado alimenticio, sin BPA, que es un material no toxico, durable y totalmente inocuo, este infusor es una forma refrescante de preparar tu bebida.</li>\r\n	<li>Ya sea que escojas hierbabuena, menta, canela o tu sabor favorito, este compa&ntilde;ero har&aacute; de todas tus hojas una bebida deliciosa.</li>\r\n	<li>Su dise&ntilde;o permite el paso del agua mas f&aacute;cilmente.&nbsp;</li>\r\n	<li>Solo rell&eacute;nalo con las hojas de t&eacute;&nbsp;que mas te gusten, gira la parte inferior y sum&eacute;rgelo en el agua caliente.&nbsp;</li>\r\n	<li>Su tanque de contrapeso hace que sea m&aacute;s f&aacute;cil mantenerlo en posici&oacute;n y al estar hecho de acero inoxidable no debes de preocuparte de que pierda su calidad al momento de lavarlo.&nbsp;</li>\r\n	<li>El silicon jam&aacute;s dejar&aacute; un sabor extra&ntilde;o en tu t&eacute;.</li>\r\n	<li>Ligero, durable, f&aacute;cil de usar.</li>\r\n	<li>Muy f&aacute;cil de limpiar, solo necesitas agua fr&iacute;a y jab&oacute;n. Es seguro para lavavajillas.&nbsp;</li>\r\n	<li>El regalo ideal para aquellos que aman el t&eacute; y los deportes acu&aacute;ticos.&nbsp;</li>\r\n	<li>Muy practico para usarse en casa o para llevarlo de viaje contigo.&nbsp;</li>\r\n</ul>\r\n\r\n<p>&nbsp;</p>\r\n', '', 'Otro', 'no', '', '', '', '', '', '', '110.00', '0.00', 'MXN', 'no', 25, 1, 1, 'No disponible para la venta', '2019-07-13 23:03:57', '2019-07-13 23:03:57', '2019-07-13 23:03:57', '6.00', '10.00', '4.00', '0.06', 'normal', 'nuevo', 0, '0.00', 'es', 'activo', 1),
(36, '5c9c1ff62ce0c3.78174962', 1, 'Set de 12 marcadores en forma de animales para copas o vasos', 'set-de-marcadores-para-copas-o-vasos', 'Divertidos y prácticos marcadores para copas y vasos en forma de animales. ', '<ul>\r\n	<li>Distingue las bebidas de cada invitado con estos 12 marcadores en colores y figuras variadas.</li>\r\n	<li>Encanta a tus invitados y has que&nbsp;sus bebidas sean f&aacute;cilmente reconocibles para que no puedan confundirlas.</li>\r\n	<li>Muy simples de usar y quitar.</li>\r\n	<li>Su chup&oacute;n de succi&oacute;n es durable y se adhiere muy bien a superficies planas no porosas como vasos, copas e incluso al acero inoxidable.</li>\r\n	<li>Puedes usarla una y otra vez.</li>\r\n	<li>No dejan residuos en tus vasos o copas.</li>\r\n	<li>Excelente regalo para cualquier amante del vino y de las reuniones con amigos.</li>\r\n</ul>\r\n\r\n<p>&nbsp;</p>\r\n', '', 'Otro', 'no', '', '', '', '', '', '', '110.00', '0.00', 'MXN', 'no', 25, 1, 1, 'No disponible para la venta', '2019-07-13 23:06:04', '2019-07-13 23:06:04', '2019-07-13 23:06:04', '10.00', '10.00', '10.00', '0.06', 'normal', 'nuevo', 0, '0.00', 'es', 'activo', 1),
(37, '5c9c1ff62ce0c3.78174962', 1, 'Set de 6 marcadores en forma de pequeños hombres para copas.', 'set-de-6-marcadores-en-forma-de-pequeños-hombres-para-copas-y-vasos', 'Marcadores para vasos y copas en forma de hombre con 6 diferentes colores. ', '<ul>\r\n	<li>Divertidos marcadores ideales para usar en tus fiestas.&nbsp;</li>\r\n	<li>Tus invitados podr&aacute;n marcar de forma clara sus bebidas y no perderlas de vista durante la noche, ni tomarse la de alguien mas.&nbsp;</li>\r\n	<li>6 colores diferentes. Fabricados en silicon.</li>\r\n	<li>Flexibles y muy durables.</li>\r\n	<li>Ligeros, pr&aacute;cticos y muy f&aacute;ciles&nbsp;de lavar.&nbsp;</li>\r\n	<li>No te quedes sin este accesorio que permitir&aacute; a tus invitados disfrutar m&aacute;s de la fiesta.&nbsp;</li>\r\n</ul>\r\n', '', 'Otro', 'no', '', '', '', '', '', '', '93.00', '0.00', 'MXN', 'no', 20, 1, 1, 'No disponible para la venta', '2019-07-15 19:06:27', '2019-07-15 19:06:27', '2019-07-15 19:06:27', '1.50', '3.50', '1.00', '0.06', 'normal', 'nuevo', 0, '0.00', 'es', 'activo', 1),
(39, '5c9c1ff62ce0c3.78174962', 1, 'Soportes para bolsa de té en forma de caracol ', 'infusores-para-té-en-forma-de-caracol', 'Adorables caracoles para sostener tu bolsita de té en la taza y evitar que se hunda. 6 piezas de colores surtidos. ', '<ul>\r\n	<li>Hechos de silic&oacute;n grado alimenticio no toxico.&nbsp;</li>\r\n	<li>Estos adorable caracoles son totalmente seguros para usarlos en tus bebidas.&nbsp;</li>\r\n	<li>Solo enrolla la tira de tu bolsa de te en el cuerpo del caracol y vierte el agua.</li>\r\n	<li>Olv&iacute;date de introducir los dedos en el agua para sacar la bolsa de t&eacute; cuando esta se va hacia adentro de la taza o cuando tu bebida est&aacute; en el punto exacto.&nbsp;&nbsp;</li>\r\n	<li>Set de 6 caracoles en colores surtidos.</li>\r\n	<li>Ligeros, durables y f&aacute;ciles de usar.&nbsp;</li>\r\n	<li>El regalo ideal para los amantes del t&eacute;.</li>\r\n</ul>\r\n\r\n<p>&nbsp;</p>\r\n', '', 'Otro', 'no', '', '', '', '', '', '', '81.00', '0.00', 'MXN', 'no', 20, 1, 1, 'No disponible para la venta', '2019-07-14 00:09:39', '2019-07-14 00:09:39', '2019-07-14 00:09:39', '0.50', '0.50', '0.50', '0.03', 'normal', 'nuevo', 0, '0.00', 'es', 'activo', 1),
(40, '5c9c1ff62ce0c3.78174962', 1, 'Coloridas sombrilla de papel ideales para protegerte de los rayos del sol', 'fabulosa-sombrilla-de-papel-ideal-para-protegerte-del-sol', 'Sombrilla de papel totalmente hecha a mano y decorada con patrones orientales.', '<ul>\r\n	<li>﻿Excepcional parasol de papel con&nbsp;10 hermosos dise&ntilde;os.</li>\r\n	<li>Totalmente realizado a mano. Con patrones&nbsp;orientales cl&aacute;sicos .</li>\r\n	<li>Ideal para protegerse de los rayos solares en estos d&iacute;as de calor intenso.</li>\r\n	<li>Una opci&oacute;n perfecta para decorar una fiesta, recamara o estancia.&nbsp;</li>\r\n	<li>Alta calidad de papel encerado.</li>\r\n	<li>Con mango de bamboo durable y resistente.&nbsp;</li>\r\n</ul>\r\n', '', 'Otro', 'no', '', '', '', '', '', '', '150.00', '0.00', 'MXN', 'no', 71, 1, 1, 'No disponible para la venta', '2019-07-14 00:07:22', '2019-07-14 00:07:22', '2019-07-14 00:07:22', '83.00', '42.00', '0.00', '0.40', 'normal', 'nuevo', 0, '0.00', 'es', 'activo', 1),
