(50, '5c9c1ff62ce0c3.78174962', 1, 'Platos para bebe fabricados con bamboo. ', 'platos-para-bebe-totalmente-reciclables', 'Divertidos platos hechos con fibra de bambú 100% reciclables. ', '<ul>\r\n	<li>Divertidos platos para comida de bebe en 8 hermosos dise&ntilde;os.</li>\r\n	<li>Hechos con fibra de bamb&uacute; 100% reciclable.</li>\r\n	<li>Has volar la imaginaci&oacute;n de tus peque&ntilde;os angelitos mientras&nbsp;los alimentas de forma nutritiva. &nbsp;</li>\r\n	<li>Seguros para lavarse en lavavajillas.&nbsp;</li>\r\n	<li>Resistentes y duraderos.&nbsp;</li>\r\n</ul>\r\n', '', 'Otro', 'no', '', '', '', '', '', '', '135.00', '0.00', 'MXN', 'no', 8, 1, 1, 'No disponible para la venta', '2019-07-13 23:14:40', '2019-07-13 23:14:40', '2019-07-13 23:14:40', '16.00', '10.00', '0.00', '0.25', 'normal', 'nuevo', 0, '0.00', 'es', 'activo', 1),
(51, '5c9c1ff62ce0c3.78174962', 1, 'Café Quetzalin ', 'café-quetzalin', 'El mejor café de altura producido en la región de Cuetzalan, Pue. ', '<ul>\r\n	<li>Libre de agroqu&iacute;micos, pesticidas y fertilizantes, este caf&eacute; artesanal es el mejor acompa&ntilde;ante cada ma&ntilde;ana si lo que buscas en disfrutar de un caf&eacute; libre de sustancias toxicas o nocivas para ti o para el ambiente.&nbsp;</li>\r\n	<li>Producido en la regi&oacute;n de Cuetzalan, Puebla, regi&oacute;n propicia para el cultivo del caf&eacute; de altura.&nbsp;</li>\r\n	<li>El caf&eacute; Cuetzalin&nbsp;ha sido producido durante generaciones en esta regi&oacute;n siguiendo t&eacute;cnicas ancestrales respetuosas con el medio ambiente.&nbsp;&nbsp;</li>\r\n	<li>Bajo el cari&ntilde;o y cuidado de diferentes generaciones, este excelente caf&eacute; crece a la sombra de los arboles a 1560 metros sobre el nivel del mar.&nbsp;</li>\r\n	<li>Variedad Ar&aacute;bica.&nbsp;</li>\r\n	<li>Tostado medio.</li>\r\n	<li>Molido medio para cafeteras de filtro o&nbsp; italianas, este caf&eacute; desprende el aroma del bosque en el que creci&oacute; y fue cosechado.&nbsp;</li>\r\n	<li>Disponible en presentaci&oacute;n de 1/2 y 1/4 de kilo.</li>\r\n	<li>No te quedes sin probar este magnifico tesoro culinario de M&eacute;xico y de ayudar a que todos aquellos que siembran, cuidan, cosechan y procesan el caf&eacute;, generen los medios necesarios para elevar su calidad de vida.&nbsp;</li>\r\n	<li>POR LANZAMIENTO, LL&Eacute;VATE UN KILOGRAMO POR $190.00</li>\r\n</ul>\r\n', '', 'México', 'si', '', '', '', '', '', '', '190.00', '0.00', 'MXN', 'no', 359, 1, 1, 'No disponible para la venta', '2019-07-15 18:44:25', '2019-07-15 18:44:25', '2019-07-15 18:44:25', '15.00', '22.00', '8.00', '0.50', 'normal', 'nuevo', 0, '0.00', 'es', 'activo', 1),
(52, '5c9c1ff62ce0c3.78174962', 1, 'Bolsas de malla para lavar ropa delicada ', 'bolsas-de-malla-para-lavar-ropa-delicada', 'Set de 5 bolsas para lavar ropa delicada y lencería.', '<ul>\r\n	<li>&iquest;Te gustar&iacute;a que tu ropa favorita se mantuviera como nueva por m&aacute;s tiempo?</li>\r\n	<li>&iquest;Y que tu&nbsp;ropa interior no pierda&nbsp;su forma en cada lavada cuando tienes que lavarlos en la lavadora?</li>\r\n	<li>No te preocupes m&aacute;s, con este set de mallas para lavar tu ropa no volver&aacute;s a sacar tus prendas favoritas de en medio de un nudo de ropa.</li>\r\n	<li>Simplemente coloca de 2 a 3 piezas de ropa en las bolsas, ci&eacute;rralas e introduce la malla&nbsp; a la lavadora con el resto de tu ropa.</li>\r\n	<li>Lava normalmente.</li>\r\n	<li>Al finalizar el ciclo de lavado podr&aacute;s sacar f&aacute;cilmente la bolsa y darle a tus prendas consentidas el mejor cuidado.</li>\r\n	<li>La bolsa no desprende ning&uacute;n tipo de pelusa.&nbsp;</li>\r\n	<li>El set incluye 1 bolsa de tama&ntilde;o peque&ntilde;o, 1 de tama&ntilde;o mediano, 1 de tama&ntilde;o grande y 2 bolsas para ropa interior.</li>\r\n</ul>\r\n', '', 'Otro', 'no', '', '', '', '', '', '', '193.00', '0.00', 'MXN', 'no', 30, 1, 1, 'No disponible para la venta', '2019-07-13 22:59:03', '2019-07-13 22:59:03', '2019-07-13 22:59:03', '2.00', '2.00', '2.00', '0.38', 'normal', 'nuevo', 0, '0.00', 'es', 'activo', 1),
(53, '5c9c1ff62ce0c3.78174962', 1, 'Set de 6 bolsas de vacío para almacenar comida en el refrigerador con bomba. ', 'bolsas-de-vacío-para-almacenar-comida-en-el-refrigerador', 'Set de 6 bolsas de vacío para guardar comida en el refrigerador. Incluyen bomba. ', '<ul>\r\n	<li>Con estas fant&aacute;sticas bolsas podr&aacute;s sentirte seguro de almacenar y congelar tus alimentos.&nbsp;</li>\r\n	<li>Puedes almacenar carnes, frutas o verduras.&nbsp;</li>\r\n	<li>Totalmente reutilisables y seguras.&nbsp;</li>\r\n	<li>Mant&eacute;n tus alimentos frescos por hasta 5 veces mas tiempo que con las formas tradicionales de almacenaje.</li>\r\n	<li>Congela tus carnes en las mejores condiciones hasta el momento de cocinarlas o conserva tus frutas favoritas para hacer esas deliciosas malteadas matutinas</li>\r\n	<li>Solo introduce tus alimentos, cierra la bolsa,&nbsp;extrae todo el aire con la bomba y listo. Puedes almacenar en tu congelador o en el refrigerador.</li>\r\n	<li>Evitan que los alimentos se quemen en el congelador.</li>\r\n	<li>Son f&aacute;ciles de lavar y tienes que preocuparte por estar desechando&nbsp;papel film o aluminio.</li>\r\n	<li>No adsorben olores, ni sabores.</li>\r\n	<li>El material es totalmente seguro para alimentos, no desprende ning&uacute;n tipo de sabor ni olor.</li>\r\n	<li>El set incluye 2 bolsas de 21 x 28 cm,&nbsp;2 bolsas de 16 x 28 cm y&nbsp;2 bolsas de 36 x 34 cm.</li>\r\n	<li>Incluyen bomba de vac&iacute;o.</li>\r\n</ul>\r\n', '', 'Otro', 'no', '', '', '', '', '', '', '212.00', '0.00', 'MXN', 'no', 15, 1, 1, 'No disponible para la venta', '2019-07-13 23:07:07', '2019-07-13 23:07:07', '2019-07-13 23:07:07', '28.00', '16.00', '1.00', '0.21', 'normal', 'nuevo', 0, '0.00', 'es', 'activo', 1),
(54, '5c9c1ff62ce0c3.78174962', 1, '6 Bolsas de vacío para almacenar ropa con bomba incluida.', 'bolsas-de-vacío-para-almacenar-ropa', 'Set de 6 bolsas para almacenaje de ropa, sabanas, toallas o cobijas. ', '<ul>\r\n	<li>No vuelvas a sufrir por no tener espacio suficiente para guardar cobijas, sabanas o la ropa extra que no quieres en tu closet.</li>\r\n	<li>Estas pr&aacute;cticas bolsas te ahorran m&aacute;s de la mitad del espacio y mantienen tu ropa libre de polvo.</li>\r\n	<li>Solo tienes que introducir la ropa limpia y totalmente seca, acomodarla cuidadosamente, cerrar la bolsa y extraer el aire con la bomba manual o con tu aspiradora.</li>\r\n	<li>En pocos segundos notaras como la bolsa comienza a desinflarse y tu ropa ocupa menos de la mitad del espacio que antes.</li>\r\n	<li>Su cierre doble y su v&aacute;lvula triple permiten que todo el aire salga e impiden que vuelva a entrar.&nbsp;</li>\r\n	<li>No te preocupes por malos olores, bacterias o moho ya que el material con las que est&aacute;n hechas no permite la formaci&oacute;n de ninguno.&nbsp;</li>\r\n	<li>Las bolsas no desprenden ning&uacute;n aroma y mantienen a tu ropa protegida del polvo, por lo que al sacarla esta estar&aacute; como reci&eacute;n lavada.</li>\r\n	<li>El set incluye 2 bolsas de 40 x 50 cm, 2 bolsas de 50 x 70 cm y 2 bolsas de 60 x 80 cm</li>\r\n	<li>Incluye bomba de vac&iacute;o.</li>\r\n</ul>\r\n', '', 'Otro', 'no', '', '', '', '', '', '', '219.00', '0.00', 'MXN', 'no', 15, 1, 1, 'No disponible para la venta', '2019-07-13 23:01:59', '2019-07-13 23:01:59', '2019-07-13 23:01:59', '40.00', '50.00', '2.00', '0.62', 'normal', 'nuevo', 0, '0.00', 'es', 'activo', 1),
