(59, '5c9c1ff62ce0c3.78174962', 1, 'Set de 4 clips para bolsas de té en forma de conejo.', 'set-de-4-clips-para-bolsas-de-té-en-forma-de-conejo', 'Lindos conejos para sujetar tu bolsa de té y evitar que se vaya al fondo de la taza. ', '<ul>\r\n	<li>Fabricados con silicon grado alimenticio, estos lindos conejos son una opci&oacute;n segura para auxiliarte al preparar tus bebidas.&nbsp;</li>\r\n	<li>Solo coloca el conejo en la orilla de la taza y enreda en sus orejas la tira de la bolsita de t&eacute;.&nbsp;</li>\r\n	<li>Nunca m&aacute;s tendr&aacute;s que estar pescando la bolsita para sacarla.&nbsp;</li>\r\n	<li>Cuando tu t&eacute; est&aacute; en el punto exacto, retira la bolsa y col&oacute;cala en la mesa sobre el conejo.&nbsp;</li>\r\n	<li>Jam&aacute;s tendr&aacute;s que volver a buscar que hacer con la bolsa mojada.&nbsp;</li>\r\n	<li>Ideales para los amantes del t&eacute;.&nbsp;</li>\r\n	<li>F&aacute;ciles de lavar. Son aptas para lavavajillas.&nbsp;</li>\r\n	<li>Set de 4 conejos en colores variados por juego.&nbsp;</li>\r\n</ul>\r\n', '', 'Otro', 'no', '', '', '', '', '', '', '124.00', '140.00', 'MXN', 'no', 6, 1, 1, 'No disponible para la venta', '2019-07-15 19:29:00', '2019-07-15 19:29:00', '2019-07-15 19:29:00', '4.00', '9.00', '1.00', '0.05', 'normal', 'nuevo', 0, '0.00', 'es', 'activo', 1),
(60, '5c9c1ff62ce0c3.78174962', 1, 'Mallas circulares para lavar ropa intima o lingerie ', 'mallas-circulares-para-lavar-ropa-intima-o-lingerie', 'Práctica bolsa para lavar ropa delicada o interior. Tus prendas delicadas se mantendrán como nuevas por más tiempo sin que tengas que lavarlas a mano. ', '<ul>\r\n	<li>Accesorio indispensables para que tus ropa interior&nbsp;mantengan su forma por mas tiempo. Sus 16 cent&iacute;metros de di&aacute;metro y 17 de alto te permiten&nbsp;colocar hasta 3 bras y evitar que se maltraten o pierdan su forma durante el lavado.</li>\r\n	<li>Su cierre abre completamente haciendo mas f&aacute;cil la tarea de llenarlos.</li>\r\n	<li>Sus anillos de soporte arriba y abajo proporcionan la rigidez necesaria para que tus delicados&nbsp;no se maltraten.</li>\r\n	<li>Fabricados con fibra de poliester de alta calidad. No deja residuos en tu ropa ni pelusa. El tama&ntilde;o de la malla permite el f&aacute;cil&nbsp;paso del agua y el jab&oacute;n dando como resultado un lavado completo.&nbsp;</li>\r\n	<li>Pueden utilizarse tambi&eacute;n para lavar juguetes de peluche peque&ntilde;os, ropa de bebe, medias y calcetines.&nbsp;</li>\r\n	<li>Incluso puedes usarlos para organizar tu ropa interior dentro de tu maleta y evitar que se maltraten o queden a la vista f&aacute;cilmente.&nbsp;</li>\r\n	<li>Medidas aproximadas: 16 x 17 cent&iacute;metros.&nbsp;</li>\r\n	<li>Colores variados.&nbsp;</li>\r\n</ul>\r\n', '', 'Otro', 'no', '', '', '', '', '', '', '125.00', '150.00', 'MXN', 'no', 20, 1, 1, 'No disponible para la venta', '2019-07-15 20:13:42', '2019-07-15 20:13:42', '2019-07-15 20:13:42', '16.00', '17.00', '0.00', '0.06', 'normal', 'nuevo', 0, '0.00', 'es', 'activo', 1);
