(1, 'Términos y Condiciones', 'términos-y-condiciones', ' ', '', 'default.jpg', 'pagina', '2019-03-15 22:10:23', '2019-03-15 22:10:23', '2019-03-15 22:10:23', 'activo', NULL),
(2, 'Aviso de Privacidad', 'aviso-de-privacidad-ok6', '     ', '<p dir=\"ltr\" style=\"line-height: 1.2; margin-top: 0pt; margin-bottom: 0pt;\"><span style=\"font-variant-numeric: normal; font-variant-east-asian: normal; text-decoration-skip-ink: none; vertical-align: baseline;\"><b><i>DECLARACIÓN DE PRIVACIDAD</i></b></span></p><p dir=\"ltr\" style=\"line-height: 1.2; margin-top: 0pt; margin-bottom: 0pt;\"><span style=\"font-variant-numeric: normal; font-variant-east-asian: normal; text-decoration-skip-ink: none; vertical-align: baseline;\"><br></span><span style=\"font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline;\">Para Abanico Siempre lo mejor S.A. de C.V. (en adelante ABANICO) la privacidad de la información de sus usuarios, compradores, proveedores y prestadores de servicios es lo más importante, por eso, y en cumplimiento a la Ley Federal de Protección de Datos Personales en Posesión de los Particulares, le informamos que somos responsables de sus datos personales, del uso y tratamiento que se le dé a los mismos y la forma en que se comparten. Para cualquier aclaración, duda o comentario sírvase contactarnos al correo electrónico </span><a href=\"mailto:atencioncliente@abanicoytu.com\" style=\"background-color: rgb(255, 255, 255);\"><span style=\"font-variant-numeric: normal; font-variant-east-asian: normal; text-decoration-skip-ink: none; vertical-align: baseline;\">atencioncliente@abanicoytu.com</span></a></p>\r\n<p dir=\"ltr\" style=\"line-height: 1.2; margin-top: 0pt; margin-bottom: 0pt;\"><span style=\"font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline;\">A continuación, se describe nuestra política de privacidad la cual acepta usted al visitar nuestra página electrónica </span><a style=\"\" href=\"http://www.abanicoytu.com\"><span style=\"font-variant-numeric: normal; font-variant-east-asian: normal; text-decoration-skip-ink: none; vertical-align: baseline;\">www.abanicoytu.com</span></a><span style=\"font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline;\"> en la cual hacemos de su conocimiento que información recabamos, con que finalidad y como es utilizada para poder realizar con confianza cualquier actividad en nuestra página. Este documento es parte de los Términos y Condiciones Generales de www.abanicoytu.com, por lo que al aceptar dicho Términos y Condiciones el usuario acepta las disposiciones aquí expuestas. </span></p>\r\n<p dir=\"ltr\" style=\"line-height: 1.2; margin-top: 0pt; margin-bottom: 0pt;\">&nbsp;</p>\r\n<p dir=\"ltr\" style=\"line-height: 1.2; margin-top: 0pt; margin-bottom: 0pt;\"><span style=\"font-variant-numeric: normal; font-variant-east-asian: normal; text-decoration-skip-ink: none; vertical-align: baseline;\"><b><i>INFORMACIÓN RECABADA</i></b></span></p><p dir=\"ltr\" style=\"line-height: 1.2; margin-top: 0pt; margin-bottom: 0pt;\"><span style=\"font-variant-numeric: normal; font-variant-east-asian: normal; text-decoration-skip-ink: none; vertical-align: baseline;\"><br></span>DIRECTAMENTE. De manera general la información que nosotros solicitamos de nuestros compradores, vendedores, prestadores de servicios, distribuidores, colaboradores y/o cualquiera persona relacionada con nosotros es: nombre completo, domicilio, teléfono, teléfono móvil, correo electrónico, edad, fecha de nacimiento, nacionalidad, RFC, datos de facturación, INE, número de INFONAVIT, número de tarjeta bancaria, identificadores de cuentas bancarias, entre otros (algunos solo aplican para nuestros colaboradores). &nbsp;Para poder confirmar los datos personales es posible que acudamos a entidades públicas, compañías especializadas o centrales de riesgo. Por lo que al registrarte nos autorizas a compartir los datos personales, financieros y patrimoniales con dichas entidades. La información que ellas arrojen será tratada de forma confidencial.</p>\r\n<p dir=\"ltr\" style=\"line-height: 1.2; margin-top: 0pt; margin-bottom: 6pt;\"><span style=\"font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline;\">Cuando un usuario se registra en www.abanicoytu.com a través de su cuenta personal en una red social estará dando su consentimiento para se le envié información o mensajes de finalidad descriptiva al correo electrónico vinculado a la cuenta personal. </span></p>\r\n<p dir=\"ltr\" style=\"line-height: 1.2; margin-top: 0pt; margin-bottom: 0pt;\"><span style=\"font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline;\">INDIRECTAMENTE. Cuando navegas en nuestra tienda recibimos de manera automática información sobre la actividad de los usuarios y visitantes tales como la URL de la que proviene, a que URL acceden, que navegador se está usando y la dirección de protocolo de internet de tu computadora (IP) con el fin de proporcionarnos información que nos ayuda a conocer acerca de su navegador y sistema operativo. &nbsp;</span></p>\r\n<p dir=\"ltr\" style=\"line-height: 1.2; margin-top: 0pt; margin-bottom: 8pt;\"><span style=\"font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline;\">Como muchas otras páginas recabamos cierto tipo de información cuando su navegador acceda a nuestra página a través de las “cookies”. No es requisito su aceptación al momento de navegar, sin embargo, habrá ciertas funciones que no puedas realizarse de manera óptima si no son aceptadas. La mayoría de los navegadores indican como configurar su navegador para que no acepte cookies. Asimismo, se puede deshabilitar o eliminar datos similares utilizados por los complementos de los navegadores. Sin embargo, recomendamos dejar habilitadas las cookies para que le sea posible utilizar funciones esenciales de nuestra página. </span></p>\r\n<p dir=\"ltr\" style=\"line-height: 1.2; margin-top: 0pt; margin-bottom: 0pt;\"><span style=\"font-variant-numeric: normal; font-variant-east-asian: normal; text-decoration-skip-ink: none; vertical-align: baseline;\"><b><i>CONSENTIMIENTO</i></b></span></p><p dir=\"ltr\" style=\"line-height: 1.2; margin-top: 0pt; margin-bottom: 0pt;\"><span style=\"font-variant-numeric: normal; font-variant-east-asian: normal; text-decoration-skip-ink: none; vertical-align: baseline;\"><br></span>ABANICO bajo ninguna circunstancia venderá, alquilará o compartirá los Datos Personales salvo en aquellas formas establecidas en el presente aviso de privacidad. Una vez que el usuario se registre en nuestra página acepta de forma expresa el uso y transferencia total o parcial de los datos personales a las entidades mencionadas en este aviso. &nbsp;Cabe recordar que en todo momento haremos todo lo posible por que tu información personal este protegida. En caso de que terceras partes intercepten o accedan a cierta información o transmisión de datos ABANICO no responderá por la información que sea revelada.</p>\r\n<p dir=\"ltr\" style=\"line-height: 1.2; margin-top: 0pt; margin-bottom: 0pt;\"><span style=\"font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline;\">Si llegara a existir una razón secundaria para solicitarte algún dato, como estudios de marketing o de análisis de información, te pediremos expresamente consentimiento para hacer uso de ella.</span></p><p dir=\"ltr\" style=\"line-height: 1.2; margin-top: 0pt; margin-bottom: 0pt;\"><span style=\"font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline;\"><br></span><b><i>USO DE LA INFORMACIÓN</i></b></p><p dir=\"ltr\" style=\"line-height: 1.2; margin-top: 0pt; margin-bottom: 0pt;\"><br></p>\r\n<p dir=\"ltr\" style=\"line-height: 1.2; margin-top: 0pt; margin-bottom: 0pt;\"><span style=\"font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline;\">Los datos personales nos sirven para brindarles a nuestros usuarios una mejor experiencia dentro de nuestra página, permitiéndonos agilizar operaciones y realizarlas de forma segura y ayudar a compradores y vendedores a contactarse de forma segura y responsable. &nbsp;También, nos permite hacerle llegar a los usuarios información sobre productos o servicios que estén relacionados con el historial de nuestros clientes, poder cumplir los acuerdos que hemos adquirido con nuestros clientes, informar sobre cambios en nuestros productos y servicios y brindar atención al usuario de forma personalizada y eficiente. </span></p>\r\n<p dir=\"ltr\" style=\"line-height: 1.2; margin-top: 0pt; margin-bottom: 0pt;\"><span style=\"font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline;\">Además de mejorar tu experiencia de compra con nosotros, tus datos nos sirven para poder conocer de forma interna cuales son los gustos, necesidades e intereses de nuestros clientes. Mejorar la forma en que nos acercamos a los clientes y como nos comunicamos con ellos. Incrementar la oferta de productos y servicios. Enviar información y mensajes sobre nuestros contenidos, noticias, publicidad, productos y servicios.</span></p><p dir=\"ltr\" style=\"line-height: 1.2; margin-top: 0pt; margin-bottom: 0pt;\"><span style=\"font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline;\"><br></span><b><i>&nbsp;<span style=\"font-variant-numeric: normal; font-variant-east-asian: normal; text-decoration-skip-ink: none; vertical-align: baseline;\">CON QUIEN COMPARTIMOS TU INFORMACIÓN</span></i></b></p><p dir=\"ltr\" style=\"line-height: 1.2; margin-top: 0pt; margin-bottom: 0pt;\"><span style=\"font-variant-numeric: normal; font-variant-east-asian: normal; text-decoration-skip-ink: none; vertical-align: baseline;\"><br></span>Dada la naturaleza de nuestra empresa debemos compartir información con todos aquellos proveedores o empresas que nos ayudan a realizar las operaciones de transporte, medios de pago, seguros, intermediarios en la gestión de pagos, empresas afiliadas, proveedores de servicios a terceros. &nbsp;Si hay un requerimiento judicial o si es necesario suministrar los datos personales a las entidades que intervengan en la resolución de disputas entre usuarios como son compañías de seguros, tribunales de arbitraje o los tribunales competentes para solucionar tales disputas.</p>\r\n<p dir=\"ltr\" style=\"line-height: 1.2; margin-top: 0pt; margin-bottom: 0pt;\"><span style=\"font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline;\">En general, los proveedores de terceras partes utilizados por nosotros solo recopilarán, usarán y divulgarán tu información en la medida que sea necesaria para que les permita desempeñar los servicios que nos proveen. Sin embargo, algunos proveedores de servicios de terceros, tales como pasarelas de pago y otros procesadores de transacciones de pago, tienen sus propias políticas de privacidad con respecto a la información que estamos obligados a proporcionarles para las transacciones relacionadas con las compras. En estos casos, te recomendamos que leas las políticas de privacidad para que puedas entender la manera en que tu información personal será manejada. En particular, recuerda que algunos proveedores pueden estar ubicados o contar con instalaciones que se encuentran en una jurisdicción diferente a ti o nosotros. &nbsp;Así que si deseas proceder con una transacción que involucra los servicios de un proveedor a terceros, tu información puede estar sujeta a las leyes de la jurisdicción(es) en que se encuentra el proveedor de servicios o sus instalaciones. A modo de ejemplo, si te encuentras en México y tu transacción es procesada por una pasarela de pago con sede en Estados Unidos, entonces tu información personal utilizada para completar la transacción puede ser sujeto de divulgación en virtud de la legislación de Estados Unidos, incluyendo la Ley Patriota.</span></p>\r\n<p dir=\"ltr\" style=\"line-height: 1.2; margin-top: 0pt; margin-bottom: 8pt;\"><span style=\"font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline;\">Una vez que abandonas el sitio web de nuestra tienda o te rediriges a un sitio o aplicación de terceros, ya no estás siendo regulados por la presente Política de Privacidad o los Términos de Servicio de nuestra página web.</span></p><p dir=\"ltr\" style=\"line-height: 1.2; margin-top: 0pt; margin-bottom: 8pt;\"><span style=\"font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline;\"><br></span><b><i>USO DE DATOS CON OTROS USUARIOS</i></b></p>\r\n<p dir=\"ltr\" style=\"line-height: 1.2; margin-top: 0pt; margin-bottom: 0pt;\"><span style=\"font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline;\">Dada la naturaleza de nuestro negocio en ocasiones se crearán interacciones entre nuestros usuarios. Esto conlleva a permitir un acceso limitado a los datos personales para que puedan establecer comunicación entre ellos, organizar la prestación de servicios y alguna otra actividad en la que haya convenido los usuarios al momento de su negociación. Sin excepción, no podrán intercambiarse datos personales de un tercero sin el consentimiento explícito de ABANICO y del usuario en cuestión.</span></p><p dir=\"ltr\" style=\"line-height: 1.2; margin-top: 0pt; margin-bottom: 0pt;\"><span style=\"font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline;\"><br></span><b><i><span style=\"font-variant-numeric: normal; font-variant-east-asian: normal; text-decoration-skip-ink: none; vertical-align: baseline;\">DERECHOS ARCO (ACCESO, RECTIFICACIÓN, CANCELACIÓN Y OPOSICIÓN) Y REVOCACIÓN DEL CONSENTIMIENTO</span></i></b></p><p dir=\"ltr\" style=\"line-height: 1.2; margin-top: 0pt; margin-bottom: 0pt;\"><span style=\"font-variant-numeric: normal; font-variant-east-asian: normal; text-decoration-skip-ink: none; vertical-align: baseline;\"><br></span>Para cualquier aclaración, modificación o revocación de los datos el usuario puede comunicarse al correo electrónico atencioncliente@abanicoytu.com</p>\r\n<p dir=\"ltr\" style=\"line-height: 1.2; margin-top: 0pt; margin-bottom: 0pt;\"><span style=\"font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline;\">Cuando el usuario quiera ejercer sus derechos ARCO o bien revocar el consentimiento que nos haya otorgado deberá de enviar directamente su solicitud al área de servicio de atención al cliente a través de la cuenta de correo atencioncliente@abanicoytu.com. La solicitud debe incluir: 1) nombre y domicilio u otro medio para establecer comunicación con el usuario, 2) copia del documento que acredite su identidad, 3) una descripción clara y precisa de la información sobre la cual se solicita ejecutar alguno o los derechos ARCO, 4) carta donde se exprese claramente el deseo de revocación del consentimiento al uso y tratamiento de los datos personales. Evaluaremos y daremos solución a su solicitud en un plazo de 25 días hábiles después del cual se le informará de la resolución a su solicitud a través del correo electrónico del que se hizo llegar la solicitud. </span></p>\r\n<p dir=\"ltr\" style=\"line-height: 1.2; margin-top: 0pt; margin-bottom: 0pt;\"><span style=\"font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline;\">Usted podrá revisar y modificar la información que nos brindó al momento de registrarse incluyendo: correo electrónico, domicilio, ciudad, región, código postal, número principal de teléfono, datos de facturación y clave. En ocasiones, mantendremos la información que ha sido modificada con el fin de resolver disputas, reclamaciones o aclaraciones con otros usuarios. Esto implica que no siempre serán eliminados de nuestras bases toda la información que solicite el usuario. </span></p>\r\n<p dir=\"ltr\" style=\"line-height: 1.2; margin-top: 0pt; margin-bottom: 0pt;\"><span style=\"font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline;\">En caso de ya no querer recibir ofertas por correo electrónico el usuario deberá modificar su configuración dentro de su perfil de usuario.</span></p><p dir=\"ltr\" style=\"line-height: 1.2; margin-top: 0pt; margin-bottom: 0pt;\"><span style=\"font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline;\"><br></span><span style=\"font-variant-numeric: normal; font-variant-east-asian: normal; text-decoration-skip-ink: none; vertical-align: baseline;\"><b><i>SEGURIDAD DE LA INFORMACIÓN</i></b></span></p><p dir=\"ltr\" style=\"line-height: 1.2; margin-top: 0pt; margin-bottom: 0pt;\"><span style=\"font-variant-numeric: normal; font-variant-east-asian: normal; text-decoration-skip-ink: none; vertical-align: baseline;\"><br></span>Para proteger tu información personal seguimos las mejores prácticas de la industria para asegurarnos de que no se dé un uso inapropiado, acceso erróneo, divulgación, alteración o destrucción de la información. La información de los métodos de pago es encriptada y enviada mediante el protocolo Secure Socket Layer (SSL) y es procesada por las pasarelas de pago en sus servidores seguros. Sus datos personales y contraseña se almacenan en nuestras bases de datos en nuestro servidor detrás de un firewall. Seguimos todos los requisitos de PCI-DSS e implementamos normas adicionales aceptadas por la industria y, aunque no existe una garantía de 100% de seguridad, nosotros hacemos todo lo posible para que no exista ningún riesgo.</p>\r\n<p dir=\"ltr\" style=\"line-height: 1.2; margin-top: 0pt; margin-bottom: 0pt;\"><span style=\"font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline;\">Cuando confirmas tu pedido es posible que algunas pasarelas de pago revelen los últimos cuatro dígitos de tu número de tarjeta de crédito. </span></p>\r\n<p dir=\"ltr\" style=\"line-height: 1.2; margin-top: 0pt; margin-bottom: 8pt;\"><span style=\"font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline;\">Para mayor protección sugerimos que te asegures de cerrar correctamente tu sesión al estar utilizando una computadora compartida. </span></p>\r\n<p><span style=\"font-variant-numeric: normal; font-variant-east-asian: normal; text-decoration-skip-ink: none; vertical-align: baseline;\"><b><i>EDAD DE CONSENTIMIENTO</i></b></span></p>\r\n<p dir=\"ltr\" style=\"line-height: 1.2; margin-top: 0pt; margin-bottom: 8pt;\"><span style=\"font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline;\">Para hacer uso de nuestros servicios debes de tener la capacidad legal para contratar, por lo que si no cumples con esta condición deberás abstenerte de proporcionar tus datos personales. Solo si tus padres o tutores están de acuerdo, y nos brindan su consentimiento por escrito, podrás registrarte en nuestra base de datos. </span></p>\r\n<p><span style=\"font-variant-numeric: normal; font-variant-east-asian: normal; text-decoration-skip-ink: none; vertical-align: baseline;\"><b><i>CAMBIOS A ESTA POLÍTICA DE PRIVACIDAD</i></b></span></p>\r\n<p dir=\"ltr\" style=\"line-height: 1.2; margin-top: 0pt; margin-bottom: 8pt;\"><span style=\"font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline;\">Nos reservamos el derecho de modificar esta política de privacidad en cualquier momento, por lo que es conveniente que te mantengas al pendiente de las modificaciones. Los cambios y aclaraciones entrarán en vigor inmediatamente después de su publicación en el sitio web. Si hacemos cambios en esta política, notificaremos aquí que ha sido actualizada, por lo que cual estás enterado de qué información recopilamos, cómo y bajo qué circunstancias, si las hubiere, la utilizamos y/o divulgamos.</span></p>', 'default.jpg', 'legales', '2019-05-24 21:17:41', '2019-05-24 21:17:41', '2019-05-24 21:17:41', 'activo', NULL);
INSERT INTO `publicaciones` (`ID_PUBLICACION`, `PUBLICACION_TITULO`, `PUBLICACION_URL`, `PUBLICACION_RESUMEN`, `PUBLICACION_CONTENIDO`, `PUBLICACION_IMAGEN`, `PUBLICACION_TIPO`, `PUBLICACION_FECHA_REGISTRO`, `PUBLICACION_FECHA_ACTUALIZACION`, `PUBLICACION_FECHA_PUBLICACION`, `PUBLICACION_ESTADO`, `ORDEN`) VALUES
(3, 'Términos y condiciones de servicio para vendedores y prestadores de servicios', 'terminos-y-condiciones-de-servicio-para-vendedores-y-prestadores-de-servicios-7oc', '                   ', '<p>T&Eacute;RMINOS Y CONDICIONES DE SERVICIO PARA VENDEDORES Y PRESTADORES DE SERVICIOS</p>\r\n\r\n<p>INFORMACI&Oacute;N GENERAL</p>\r\n\r\n<p><strong><em>ACUERDO PARA VENDEDORES DE LA TIENDA EN L&Iacute;NEA </em></strong></p>\r\n\r\n<p>La empresa Abanico Siempre lo mejor S. A. de C. V., en adelante &ldquo;ABANICO&rdquo; ofrece este sitio web <a href=\"http://www.abanicoytu.com/\">www.abanicoytu.com</a> en adelante &ldquo;EL SITIO&rdquo;. En todo el sitio, los t&eacute;rminos &ldquo;nosotros&rdquo; y &ldquo;nuestro&rdquo; se refieren a Abanico Siempre lo mejor S.A. de C.V., e incluye toda la informaci&oacute;n, herramientas y servicios disponibles para ti, VENDEDORES(AS) / PRETADORES(AS), quienes est&aacute;n condicionados a aceptar todos los t&eacute;rminos, condiciones, pol&iacute;ticas y notificaciones aqu&iacute; establecidos para poder tener acceso a EL SITIO y ofertar sus productos y/o servicios.</p>\r\n\r\n<p><strong><em>ACEPTACI&Oacute;N DE LOS T&Eacute;RMINOS DE USO</em></strong></p>\r\n\r\n<p>Al acceder, navegar y anunciarte en EL SITIO de ABANICO, los VENDEDORES(AS)/PRETADORES(AS) aceptan sujetarse a los T&eacute;rminos y Condiciones sin limitaci&oacute;n o condici&oacute;n alguna, incluyendo las actualizaciones, modificaciones y adiciones que ABANICO publique. Dada la naturaleza de ABANICO, algunos sitios o servicios pueden estar regulados por t&eacute;rminos y condiciones adicionales, por lo que sugerimos al p&uacute;blico lea atentamente tales t&eacute;rminos en las secciones correspondientes. Las condiciones de servicio aqu&iacute; expuestas aplican a todos los usuarios del sitio, incluyendo sin limitaci&oacute;n a usuarios que sean navegadores, vendedores, prestadores de servicios, proveedores, clientes, comerciantes, y/o colaboradores de contenido.</p>\r\n\r\n<p>Por favor, lee estos &ldquo;T&eacute;rminos y Condiciones&rdquo; cuidadosamente antes de acceder o utilizar nuestro sitio web ya que al acceder o utilizar cualquier parte del sitio, est&aacute;s aceptando los T&eacute;rminos y Condiciones. Si no est&aacute;s de acuerdo con ellos no deber&iacute;as acceder a la p&aacute;gina web o usar cualquiera de los servicios. ABANICO se reserva el derecho de efectuar modificaciones o cambios en estos T&eacute;rminos y Condiciones sin necesidad de notificar personalmente a VENDEDORES(AS)/PRETADORES(AS) y ser&aacute; la &uacute;ltima versi&oacute;n la que aplique en todo momento dejando sin validez cualquier documento publicado anteriormente.</p>\r\n\r\n<p><strong><em>T&Eacute;RMINOS GENERALES</em></strong></p>\r\n\r\n<p>Entiendes que la informaci&oacute;n que nos brindes, sin incluir la informaci&oacute;n de tu tarjeta de cr&eacute;dito, puede ser transferida sin encriptar y/o involucrar transmisiones a trav&eacute;s de varias redes y cambios para ajustarse o adaptarse a los requisitos t&eacute;cnicos de conexi&oacute;n de redes o dispositivos. La informaci&oacute;n de tarjetas de cr&eacute;dito estar&aacute; siempre encriptada durante la transferencia a trav&eacute;s de las redes.</p>\r\n\r\n<p>Est&aacute;s de acuerdo con no reproducir, duplicar, copiar, vender, revender o explotar cualquier parte del servicio, uso del servicio, o acceso al servicio o cualquier contacto en el sitio web a trav&eacute;s del cual se presta el servicio, sin el expreso permiso por escrito de nuestra parte. Los t&iacute;tulos utilizados en este acuerdo se incluyen solo por conveniencia y no limita o afecta a estos T&eacute;rminos de Servicio.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong><em>RESTRICCI&Oacute;N DE EDAD</em></strong></p>\r\n\r\n<p>Al utilizar este sitio, declaras que tienes al menos la mayor&iacute;a de edad en tu estado o provincia de residencia, o nos has hecho llegar la documentaci&oacute;n que acredite un permiso por parte de tus padres, tutores o representantes legales para que accedas a EL SITIO.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong><em>REGISTRO DE VENDEDORES(AS)/PRETADORES(AS)</em></strong></p>\r\n\r\n<p>Para hacer uso de EL SITIO y/o los servicios prestados por ABANICO los VENDEDORES(AS)/PRETADORES(AS) deber&aacute;n estar registrados a trav&eacute;s de una cuenta en la p&aacute;gina <a href=\"http://www.abanicoytu.com/\">www.abanicoytu.com</a> e ingresando toda la informaci&oacute;n solicitada de manera clara, precisa y verdadera. La actualizaci&oacute;n de los datos personales es entera responsabilidad los VENDEDORES(AS)/PRETADORES(AS) la cual deber&aacute; realizarse cada vez que exista alg&uacute;n cambio en la misma. ABANICO podr&aacute; requerir alg&uacute;n comprobante y/o dato adicional que nos permitan validar la informaci&oacute;n brindada por los VENDEDORES(AS)/PRETADORES(AS) sin que esto implique que ABANICO se responsabiliza por la veracidad de la informaci&oacute;n que estos proporcionen. De no poder comprobarse la informaci&oacute;n, ABANICO se reserva el derecho de suspender temporal o definitivamente sus anuncios. Los VENDEDORES(AS)/PRETADORES(AS) garantizan y responden, en cualquier caso, de la veracidad de la informaci&oacute;n que est&aacute;n dando.</p>\r\n\r\n<p>Una vez registrados los VENDEDORES(AS)/PRETADORES(AS) generaran una contrase&ntilde;a de acceso y solo ellos ser&aacute;n los &uacute;nicos responsables de asegurar su contrase&ntilde;a y de las actividades que ocurran bajo el uso de la cuenta o contrase&ntilde;a. En caso de detectar un mal uso de la cuenta o contrase&ntilde;a los VENDEDORES(AS)/PRETADORES(AS) deber&aacute;n de indic&aacute;rnoslo inmediatamente. En ning&uacute;n caso ABANICO ser&aacute; responsable por p&eacute;rdidas o da&ntilde;os de cualquier tipo incurridos como resultado de la falta de cumplimiento de esta condici&oacute;n.</p>\r\n\r\n<p>Si llegara a detectarse un uso fraudulento, malintencionado o contrario a estos T&eacute;rminos y Condiciones, un uso de nuestros productos con alg&uacute;n prop&oacute;sito ilegal o no autorizado y/o la violaci&oacute;n de cualquier ley jurisdiccional, ABANICO se reserva el derecho de dar por terminada cualquier relaci&oacute;n comercial, suspender definitivamente las cuentas e incluso colaborar judicialmente para la persecuci&oacute;n de los infractores, sin que esto genere alg&uacute;n derecho a indemnizaci&oacute;n o resarcimiento.</p>\r\n\r\n<p><strong><em>PRIVACIDAD DE LA INFORMACION REGISTRADA POR LOS </em></strong><strong>VENDEDORES(AS) / PRETADORES(AS)</strong></p>\r\n\r\n<p>ABANICO se compromete en todo momento a cumplir las leyes de protecci&oacute;n de datos personales aplicables y a los T&eacute;rminos de su Aviso de Privacidad, el cual puede ser consultado en la direcci&oacute;n web https://</p>\r\n\r\n<p><strong><em>PROPIEDAD INTELECTUAL DE ABANICO</em></strong></p>\r\n\r\n<p>EL SITIO est&aacute; protegido por las leyes de derecho de autor y propiedad industrial tanto en M&eacute;xico como en aquellas zonas donde los tratados internacionales en la materia tengan injerencia. ABANICO tiene la propiedad de los derechos de autor del contenido y el software de su sitio web. Todos los derechos no otorgados en estos T&eacute;rminos y Condiciones quedan reservados. Queda absolutamente prohibido reproducir y/o distribuir cualquier material del sitio de ABANICO. ABANICO NO otorga ning&uacute;n permiso para hacer uso del material que se encuentre en su sitio web.</p>\r\n\r\n<p><strong><em>ACTIVIDADES ILEGALES Y/O PERJUDICIALES</em></strong></p>\r\n\r\n<p>Los VENDEDORES(AS)/PRETADORES(AS) aceptan NO realizar ning&uacute;n tipo de comportamiento ilegal como: 1) utilizar el sitio <a href=\"http://www.abanicoytu.com/\">www.abanicoytu.com</a> para fines il&iacute;citos; 2) acosar, abusar, insultar, da&ntilde;ar, difamar, calumniar, desprestigiar, intimidar o discriminar por razones de g&eacute;nero, orientaci&oacute;n sexual, religi&oacute;n, etnia, raza, edad, nacionalidad o discapacidad u hostigar de manera electr&oacute;nica a otra persona; 3) atentar contra la privacidad de otras personas; 4) distribuir o transmitir cualquier gusano, virus, c&oacute;digo o programas perjudiciales por medio del sitio www.abanicoytu.com; 5) introducir publicidad no autorizada; 6) incluir material obsceno; 7) incluir redireccionamiento o servidores proxy; 8) interferir, alterar o modificar el funcionamiento, los servidores o redes conectados a www.abanicoytu.com; 9) ejecutar programas o mantener una conexi&oacute;n de marcado activa o de cualquier otra forma eludir la desconexi&oacute;n autom&aacute;tica por inactividad; 10) utilizar EL SITIO en violaci&oacute;n de las disposiciones de cualquier otro proveedor de sitios web, en dichos sitios web, salas de chat o elementos similares; 11) utilizar EL SITIO para acceder a las cuentas de otras personas sin su autorizaci&oacute;n; 12) intentar vulnerar las medidas de seguridad de EL SITIO u obtener o eludir las contrase&ntilde;as de otras personas; 13) participar en acciones dise&ntilde;adas para afectar el acceso a la red bombardeando un sitio o cualquier red de Internet con tr&aacute;fico in&uacute;til; 14) pedirle a otros que realicen o participen en actos il&iacute;citos; 15) violar cualquier regulaci&oacute;n, reglas, leyes internacionales, federales, provinciales o estatales, u ordenanzas locales; 16) para infringir o violar el derecho de propiedad intelectual nuestro o de terceras partes; 17) presentar informaci&oacute;n falsa o enga&ntilde;osa; 18) recopilar o rastrear informaci&oacute;n personal de otros; 19) generar spam, phish, pharm, pretext, spider, crawl, or scrape; 20) cualquier prop&oacute;sito obsceno o inmoral; o 21) para interferir con o burlar los elementos de seguridad del Servicio o cualquier sitio web relacionado.</p>\r\n\r\n<p><strong><em>PUBLICACI&Oacute;N DE PRODUCTOS Y SERVICIOS</em></strong></p>\r\n\r\n<p><strong>Existen dos formas por medio de las cuales los VENDEDORES(AS)/PRETADORES(AS) podr&aacute;n ofertar sus productos o servicios:</strong></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<ol>\r\n	<li>Publicando ellos mismos su informaci&oacute;n, siguiendo los sencillos pasos que se muestran en EL SITIO. En el caso de los diferentes productos, todas las publicaciones sin excepci&oacute;n deber&aacute;n incluir fotograf&iacute;as del producto, informaci&oacute;n detallada y precisa de las caracter&iacute;sticas del producto, por ejemplo: tama&ntilde;o, material, usos, modificaciones de uso de ser necesario, requerimientos especiales como voltajes, uso de bater&iacute;a, etc. Se da por entendido que por el simple hecho de subir la publicaci&oacute;n en EL SITIO los VENDEDOR(AS) est&aacute;n poniendo a la venta su(s) producto(s) y que tienen la facultad legal, y el permiso de su titular, para venderlo. As&iacute; mismo, queda entendido que los VENDEDOR(AS) poseen el art&iacute;culo en existencia, listo para su entrega y que cumple con todos los permisos fiscales ante las autoridades nacionales e internacionales para poder venderlo. De detectarse cualquier infracci&oacute;n en estos t&eacute;rminos ABANICO est&aacute; facultado para solicitar la modificaci&oacute;n de la(s) publicaci&oacute;n(es) o bien darlas de baja de EL SITIO.</li>\r\n</ol>\r\n\r\n<p>Una vez que la informaci&oacute;n sea cargada en el sistema se realizar&aacute; un seguimiento por parte de ABANICO para determinar la veracidad de la informaci&oacute;n presentada. Es derecho de ABANICO solicitar al vendedor pruebas de la procedencia legal de la mercanc&iacute;a, as&iacute; como otros documentos relacionados con el vendedor o la empresa.</p>\r\n\r\n<p>Para el caso de los servicios, los PRESTADOR(AS) deber&aacute;n incluir una descripci&oacute;n detallada del tipo de servicio que ofrece, as&iacute; como un rango de costo aproximado. Deber&aacute; de especificarse el &aacute;rea o regiones que el prestador est&aacute; dispuesto a atender y los horarios en los que se realizan los servicios.</p>\r\n\r\n<p>Todos los VENDEDORES(AS)/PRETADORES(AS) deber&aacute;n abstenerse de publicar, distribuir o transmitir cualquier contenido que sea il&iacute;cito, acosador, difamatorio, abusivo, amenazante, obsceno, doloso, calumnioso o invasivo de la privacidad de otro individuo. Que viole o vulnere los derechos de autor, marcas, secretos industriales, patentes u otros derechos de propiedad intelectual de cualquier parte, incluyendo sin limitaci&oacute;n el uso de materiales de terceros protegidos por la ley de derechos de autor sin la autorizaci&oacute;n correspondiente, utilizar marcas de terceros sin la autorizaci&oacute;n o atribuci&oacute;n correspondiente, y utilizar o distribuir informaci&oacute;n de terceros protegida o no como secreto industrial en violaci&oacute;n a cualquier obligaci&oacute;n de confidencialidad.</p>\r\n\r\n<ol>\r\n	<li>Previo acuerdo con ABANICO para que su informaci&oacute;n sea subida al EL SITIO por parte de nuestro departamento encargado. En este caso los VENDEDORES(AS)/PRETADORES(AS), deber&aacute;n contactarse con ABANICO al correo electr&oacute;nico <a href=\"mailto:ventas@abanicoytu.com\">ventas@abanicoytu.com</a>&nbsp;para determinar qu&eacute; mecanismos de publicaci&oacute;n son los que se adaptan mejor a las caracter&iacute;sticas de sus productos o servicios.</li>\r\n</ol>\r\n\r\n<p><strong>En ambos casos se deber&aacute;n anexar a su registro la siguiente documentaci&oacute;n: </strong></p>\r\n\r\n<p><strong>VENDEDOR(AS)</strong></p>\r\n\r\n<p>1. Identificaci&oacute;n oficial</p>\r\n\r\n<p>2. Comprobante de domicilio</p>\r\n\r\n<p>3. RFC en caso de estar inscrito bajo el R&eacute;gimen de Incorporaci&oacute;n Fiscal o ser una persona Moral.</p>\r\n\r\n<p>4. Estado de cuenta bancario donde se observe claramente el numero de la cuenta y la CLABE interbancaria.</p>\r\n\r\n<p>5. De tratarse de una persona moral ser&aacute; necesario anexar la copia del acta constitutiva de la empresa.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>PRESTADORES (AS)</strong></p>\r\n\r\n<p>1. Identificaci&oacute;n oficial</p>\r\n\r\n<p>2. Comprobante de domicilio</p>\r\n\r\n<p>3. N&uacute;mero de tel&eacute;fono activo al momento de registrarse</p>\r\n\r\n<p>4. Dos n&uacute;meros telef&oacute;nicos de personas que extiendan una recomendaci&oacute;n para el prestador de servicio o 2 cartas de recomendaci&oacute;n donde se indiquen los servicios que han sido prestados con anterioridad.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Una vez registrados en la p&aacute;gina y entregada la documentaci&oacute;n ABANICO se pondr&aacute; en contacto con los vendedores y prestadores para confirmar la informaci&oacute;n. Con todos los requisitos cubiertos, la tienda y/o el anuncio ser&aacute;n dados de alta en un periodo m&aacute;ximo de 4 d&iacute;as h&aacute;biles. De no entregarse tal informaci&oacute;n requerida ABANICO se reserva el derecho de suspender temporalmente el anuncio o eliminarlo de forma definitiva de EL SITIO.</p>\r\n\r\n<p>En aquellos casos que la publicaci&oacute;n y/o comercializaci&oacute;n de productos y/o servicios est&eacute;n relacionados con el consumo de tabaco y alcohol los VENDEDORES(AS)/PRETADORES(AS) estar&aacute;n obligado a a&ntilde;adir dentro del anuncio una leyenda visible, clara y precisa que estos productos o servicios est&aacute;n limitados para aquellas personas mayores de 18 a&ntilde;os.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong><em>SERVICIO DE RECOLECCI&Oacute;N, ALMACENAJE Y ENTREGA POR PARTE DE ABANICO</em></strong></p>\r\n\r\n<p>Los VENDEDOR(AS) podr&aacute;n:</p>\r\n\r\n<p>1. Tener bajo su resguardo los productos y ser los responsables del manejo y env&iacute;o de los mismos al momento que se realice una compra. Bajo este esquema, los VENDEDORES(AS) asumen totalmente la responsabilidad de la entrega en tiempo y forma de los productos.</p>\r\n\r\n<p>2. Tener bajo su resguardo los productos y al momento de realizarse una venta coordinarse con ABANICO para obtener una gu&iacute;a de env&iacute;o prepagada con la que puedan hacer llegar sus productos a los compradores. En este caso los VENDEDORES(AS) aceptan las comisiones y condiciones que Abanico se&ntilde;ale.</p>\r\n\r\n<p>3. Acceder a los servicios de almacenaje y entrega de ABANICO. Bajo este esquema los VENDEDORES(AS) deber&aacute;n:</p>\r\n\r\n<p>a) Dar de alta sus productos en la plataforma.</p>\r\n\r\n<p>b) Enviar una relaci&oacute;n describiendo a detalle el n&uacute;mero de productos, dimensiones, pesos, caracter&iacute;sticas y precios. La entrega de los productos deber&aacute; realizarse antes de 48 h posteriores al registro en un horario de 9:30 a 15:00 h. De existir discrepancia al momento de la entrega entre el n&uacute;mero de productos registrados y el enviado al almac&eacute;n se suspender&aacute; la recepci&oacute;n de los mismos. Una vez recibidos los productos se enviar&aacute; una confirmaci&oacute;n de recepci&oacute;n o, de ser el caso, una carta de rechazo explicando el por qu&eacute; los productos no pueden ser almacenados.</p>\r\n\r\n<p>c) &Uacute;nicamente el personal de ABANICO ser&aacute; el encargado de realizar el inventario dentro de la bodega y de la manipulaci&oacute;n de los productos.</p>\r\n\r\n<p>d) Si los VENDEDORES(AS) entregan los productos ya listos para su entrega, ABANICO no se har&aacute; responsable por da&ntilde;os o perdidas que pudieran ocurrir debidos a un mal empacado y protecci&oacute;n de los productos. Por esta raz&oacute;n, los VENDEDORES(AS) deber&aacute;n de firmar una carta de liberaci&oacute;n de responsabilidad por parte de ABANICO. Caso contrario, si los VENDEDORES(AS) entregan sus productos para que ABANICO se encargue del empacado, embalaje y traslado, ser&aacute; completa responsabilidad de ABANICO cualquier da&ntilde;o que los productos puedan sufrir una vez que hayan sido entregados en el dep&oacute;sito. ABANICO responder&aacute; en caso de p&eacute;rdida total o parcial de los productos siempre y cuando las causas sean directamente imputables. Si la perdida es el resultado de causas totalmente ajenas a ABANICO este no se responsabilizar&aacute; por las mismas.</p>\r\n\r\n<p>e) De ning&uacute;n modo ABANICO devolver&aacute; a los VENDEDORES(AS) los productos que ya est&eacute;n destinados a ser entregados a EL COMPRADOR o cuando exista alg&uacute;n saldo pendiente.</p>\r\n\r\n<p>f) Los costos por concepto de almacenaje en las instalaciones de ABANICO son: $210.00 mensuales por metro c&uacute;bico ($210.00 x m3) o la cantidad proporcional que sus productos necesiten. Esta tarifa est&aacute; sujeta a modificaciones, mismas que deber&aacute;n ser dadas a conocer por ABANICO con al menos 15 d&iacute;as naturales de anticipaci&oacute;n.</p>\r\n\r\n<p>g) Los costos de manejo ser&aacute;n del 8% cuando ABANICO se encargue de todo el proceso de embalaje. Esto incluye empacado, entrega al servicio de mensajer&iacute;a y rastreo del env&iacute;o hasta su entrega al cliente final.</p>\r\n\r\n<p>h) Los costos de env&iacute;o corresponder&aacute;n a las tarifas que las compa&ntilde;&iacute;as de entrega se&ntilde;alen. Dado que es un servicio externo totalmente ajeno del control de ABANICO al precio se&ntilde;alado ser&aacute; necesario agregarle el IVA.</p>\r\n\r\n<p>Los VENDEDORES(AS) aceptan que todo costo relacionado por almacenaje, manejo y entrega sea descontado del monto final por concepto de las ventas generadas. De no haber forma de realizar el descuento, los gastos deber&aacute;n de ser cubiertos por los VENDEDORES(AS) a m&aacute;s tardar 5 d&iacute;as naturales posteriores a la fecha de contrato. Si el monto no ha sido cubierto durante dos meses consecutivos la mercanc&iacute;a ser&aacute; retenida y los VENDEDORES(AS) aceptan que no podr&aacute;n ejercer ning&uacute;n tipo de acci&oacute;n legal que implique la devoluci&oacute;n, reposici&oacute;n o indemnizaci&oacute;n por tal mercanc&iacute;a.</p>\r\n\r\n<p><strong><em>COSTO DE LOS PLANES </em></strong></p>\r\n\r\n<p><strong>C