os para su entrega.</li>\r\n	<li>Cuando los materiales contenidos en el paquete puedan da&ntilde;ar otros paquetes o representen un peligro un riesgo para el equipo o empleados de ABANICO o de sus prestadores de servicios.</li>\r\n	<li>Que el paquete no se encuentre debidamente embalado para su transporte.</li>\r\n	<li>Que el paquete no incluya la gu&iacute;a de env&iacute;o con todos los datos tanto del remitente como del destinatario.</li>\r\n	<li>Que el peso, volumen y/o apariencia del empaque no coincidan con los descritos en la gu&iacute;a de env&iacute;o.</li>\r\n</ol>\r\n\r\n<p>Con el objetivo de verificar lo anterior, ABANICO se reserva el derecho de inspeccionar todos los paquetes o de permitir a las autoridades competentes llevar a cabo las inspecciones adecuadas.</p>\r\n\r\n<p>Si llegamos a detectar que los VENDEDORES(AS) est&aacute;n haciendo mal uso de los m&eacute;todos de entrega de ABANICO al falsear la informaci&oacute;n referente al peso, volumen o cantidad de productos que ser&aacute;n enviados ABANICO considerar&aacute; que est&aacute;n faltando a los presentes T&eacute;rminos de Servicio y deber&aacute;n cubrir los costos del traslado desde el punto de recolecci&oacute;n hasta la bodega de ABANICO y de vuelta hacia el punto de recolecci&oacute;n. Adem&aacute;s, los VENDEDORES(AS) deber&aacute;n cubrir el cargo por generaci&oacute;n de la gu&iacute;a liquidando el costo real que debi&oacute; de ser cobrado de acuerdo al peso y n&uacute;mero de productos sin tener derecho al descuento en la tarifa que ABANICO ofrece.</p>\r\n\r\n<p>En caso de que estos costos no sean cubiertos con el saldo que los VENDEDORES(AS) tengan se requerir&aacute; su pago en un periodo no mayor a 10 d&iacute;as naturales a partir de la notificaci&oacute;n de la penalizaci&oacute;n. De no realizarse el pago en este plazo la tienda ser&aacute; dado de baja inmediatamente de la p&aacute;gina y la mercanc&iacute;a quedar&aacute; a consignaci&oacute;n de ABANICO. En este caso los VENDEDORES(AS) no podr&aacute;n ejercer acci&oacute;n legal alguna en contra de ABANICO que implique la devoluci&oacute;n, indemnizaci&oacute;n o reposici&oacute;n de los productos.</p>\r\n\r\n<p><strong><em>CAMBIOS Y DEVOLUCIONES</em></strong></p>\r\n\r\n<p>Los gastos derivados de las devoluciones ser&aacute;n cubiertos por los VENDERORES(AS).</p>\r\n\r\n<p><strong><em>EXACTITUD, EXHAUSTIVIDAD Y ACTUALIDAD DE LA INFORMACI&Oacute;N</em></strong></p>\r\n\r\n<p>A pesar de que intentamos hacer una revisi&oacute;n exhaustiva de todo el material que ingresa a nuestra p&aacute;gina, no nos hacemos responsables si la informaci&oacute;n disponible en este sitio no es exacta, completa o actual. El material en este sitio es provisto solo para informaci&oacute;n general y no debe confiarse en ella o utilizarse como la &uacute;nica base para la toma de decisiones sin consultar, primeramente, informaci&oacute;n m&aacute;s precisa, completa u oportuna. Los VENDEDORES(AS) tienen la obligaci&oacute;n de detallar lo m&aacute;s posible las caracter&iacute;sticas de sus productos, as&iacute; como de presentar la informaci&oacute;n gr&aacute;fica y textual m&aacute;s clara y precisa de los mismos. Los VENDEDORES(AS) deber&aacute;n responder a todas las preguntas o solucionar las dudas que EL COMPRADOR externe a trav&eacute;s de nuestra secci&oacute;n de preguntas. De detectarse que los VENDEDORES(AS) no est&aacute;n respondiendo las inquietudes de EL COMPRADOR la p&aacute;gina ser&aacute; dada de baja por un per&iacute;odo de 8 d&iacute;as naturales.</p>\r\n\r\n<p><strong><em>MODIFICACIONES AL SERVICIO Y PRECIOS</em></strong></p>\r\n\r\n<p>Los precios de nuestros servicios para los VENDEDORES(AS)/PRESTADORES(AS) est&aacute;n sujetos a cambio o modificaciones, mismos que ser&aacute;n dados a conocer con al menos 30 d&iacute;as naturales previos a la implementaci&oacute;n de los mismos. De igual modo, nos reservamos el derecho de modificar o discontinuar el servicio (o cualquier parte del contenido) en cualquier momento sin aviso previo. Por lo anterior, no seremos responsables ante ti o alguna tercera parte por cualquier modificaci&oacute;n, cambio de precio, suspensi&oacute;n o discontinuidad del Servicio.</p>\r\n\r\n<p><strong><em>PRODUCTOS Y/O SERVICIOS</em></strong></p>\r\n\r\n<p>Es responsabilidad de los VENDEDOR(ES)/PRESTADORES(AS) mantener actualizado el inventario de sus productos y su informaci&oacute;n de contacto en la p&aacute;gina cuando no se encuentren bajo el esquema de contrataci&oacute;n de los servicios de almacenaje y entrega de ABANICO. De no mantener la informaci&oacute;n al d&iacute;a ABANICO dar&aacute; de baja la publicaci&oacute;n por un per&iacute;odo de 7 d&iacute;as naturales.</p>\r\n\r\n<p><strong><em>EXCLUSI&Oacute;N DE GARANT&Iacute;AS Y LIMITACI&Oacute;N DE RESPONSABILIDAD</em></strong></p>\r\n\r\n<p>No garantizamos ni aseguramos que el uso de nuestro servicio ser&aacute; ininterrumpido, puntual, seguro o libre de errores. No garantizamos que los resultados que se puedan obtener del uso del servicio ser&aacute;n exactos o confiables. Aceptas que de manera ocasional podemos quitar el servicio por per&iacute;odos indefinidos o cancelar el servicio en cualquier momento sin previo aviso. Aceptas expresamente que el uso de, o la posibilidad de utilizar, el servicio es bajo tu propio riesgo. Los productos y servicios proporcionados a trav&eacute;s del servicio son (salvo lo expresamente manifestado por nosotros) proporcionados &quot;de la forma en que se presentan&quot; y &quot;de acuerdo a su disponibilidad&quot; para su uso, sin ning&uacute;n tipo de representaci&oacute;n, garant&iacute;as o condiciones, ya sea expresa o impl&iacute;cita, incluidas todas las garant&iacute;as o condiciones impl&iacute;citas de comercializaci&oacute;n, calidad comercializable, la aptitud para un prop&oacute;sito particular, durabilidad, t&iacute;tulo y no infracci&oacute;n.</p>\r\n\r\n<p>En ning&uacute;n caso Abanico Siempre lo mejor S.A. de C.V., nuestros directores, funcionarios, empleados, afiliados, agentes, contratistas, internos, proveedores, prestadores de servicios o licenciantes ser&aacute;n responsables por cualquier da&ntilde;o, p&eacute;rdida, reclamo, o da&ntilde;os directos, indirectos, incidentales, punitivos, especiales o consecuentes de cualquier tipo, incluyendo, sin limitaci&oacute;n, p&eacute;rdida de beneficios, p&eacute;rdida de ingresos, p&eacute;rdida de ahorros, p&eacute;rdida de datos, costos de reemplazo, o cualquier da&ntilde;o similar, ya sea basado en contrato, agravio (incluyendo negligencia), responsabilidad estricta o de otra manera, como consecuencia del uso de cualquiera de los servicios o productos adquiridos mediante el servicio, o por cualquier otro reclamo relacionado de alguna manera con el uso del servicio o cualquier producto, incluyendo pero no limitado, a cualquier error u omisi&oacute;n en cualquier contenido, o cualquier p&eacute;rdida o da&ntilde;o de cualquier tipo incurridos como resultado de la utilizaci&oacute;n del servicio o cualquier contenido (o producto) publicado, transmitido, o que se pongan a disposici&oacute;n a trav&eacute;s del servicio, incluso si se avisa de su posibilidad. Debido a que algunos estados o jurisdicciones no permiten la exclusi&oacute;n o la limitaci&oacute;n de responsabilidad por da&ntilde;os consecuenciales o incidentales, en tales estados o jurisdicciones, nuestra responsabilidad se limitar&aacute; en la medida m&aacute;xima permitida por la ley.</p>\r\n\r\n<p><strong><em>INDEMNIZACI&Oacute;N</em></strong></p>\r\n\r\n<p>Los VENDEDORES(AS) aceptan indemnizar, defender y mantener indemne a Abanico Siempre lo mejor S.A. de C.V. y nuestras matrices, subsidiarias, afiliados, socios, funcionarios, directores, agentes, contratistas, concesionarios, proveedores de servicios, subcontratistas, proveedores, internos y empleados, de cualquier reclamo o demanda, incluyendo honorarios razonables de abogados, hechos por cualquier tercero a causa o como resultado de su incumplimiento de las Condiciones de Servicio o de los documentos que incorporan como referencia, o la violaci&oacute;n de cualquier ley o de los derechos de un tercero.</p>\r\n\r\n<p><strong><em>COMENTARIOS DE USUARIO, CAPTACI&Oacute;N Y OTROS ENV&Iacute;OS</em></strong></p>\r\n\r\n<p>Si, a solicitud nuestra, env&iacute;as ciertas presentaciones espec&iacute;ficas (por ejemplo, la participaci&oacute;n en concursos) o sin una solicitud de nuestra parte env&iacute;as ideas creativas, sugerencias, proposiciones, planes, u otros materiales, ya sea en l&iacute;nea, por email, por correo postal, o de otra manera (colectivamente, &#39;comentarios&#39;), aceptas que podamos, en cualquier momento, sin restricci&oacute;n, editar, copiar, publicar, distribuir, traducir o utilizar por cualquier medio comentarios que nos hayas enviado. No tenemos ni tendremos ninguna obligaci&oacute;n de mantener ning&uacute;n comentario confidencialmente, de pagar compensaci&oacute;n por comentarios o de responder a comentarios.</p>\r\n\r\n<p>Nosotros podemos, pero no tenemos obligaci&oacute;n de, monitorear, editar o remover contenido que consideremos sea ileg&iacute;timo, ofensivo, amenazante, calumnioso, difamatorio, pornogr&aacute;fico, obsceno u objetable o viole la propiedad intelectual de cualquiera de las partes o los T&eacute;rminos de Servicio.</p>\r\n\r\n<p>Aceptas que tus comentarios no violar&aacute;n los derechos de terceras partes, incluyendo derechos de autor, marca, privacidad, personalidad u otros derechos personales o de propiedad. Asimismo, aceptas que tus comentarios no contienen material difamatorio o ilegal, abusivo u obsceno, o contienen virus inform&aacute;ticos u otro malware que pudiera, de alguna manera, afectar el funcionamiento del Servicio o de cualquier sitio web relacionado. No puedes utilizar una direcci&oacute;n de correo electr&oacute;nico falsa, usar otra identidad que no sea leg&iacute;tima, o enga&ntilde;ar a terceras partes o a nosotros en cuanto al origen de tus comentarios. T&uacute; eres el &uacute;nico responsable por los comentarios que haces y su precisi&oacute;n. No nos hacemos responsables y no asumimos ninguna obligaci&oacute;n con respecto a los comentarios publicados por ti o cualquier tercer parte.</p>\r\n\r\n<p><strong><em>ERRORES, INEXACTITUDES Y OMISIONES</em></strong></p>\r\n\r\n<p>De vez en cuando puede haber informaci&oacute;n en nuestro sitio que contiene errores tipogr&aacute;ficos, inexactitudes u omisiones que puedan estar relacionadas con las descripciones de productos, precios, promociones, ofertas, gastos de env&iacute;o del producto, el tiempo de tr&aacute;nsito y la disponibilidad. Nos reservamos el derecho de corregir los errores, inexactitudes u omisiones y de cambiar o actualizar la informaci&oacute;n o cancelar pedidos si alguna informaci&oacute;n en el Servicio o en cualquier sitio web relacionado es inexacta en cualquier momento sin previo aviso (incluso despu&eacute;s de que hayas enviado tu orden).</p>\r\n\r\n<p>No asumimos ninguna obligaci&oacute;n de actualizar, corregir o aclarar la informaci&oacute;n incluyendo, sin limitaci&oacute;n, la informaci&oacute;n de precios, excepto cuando sea requerido por la ley. Ninguna especificaci&oacute;n actualizada o fecha de actualizaci&oacute;n aplicada en EL Servicio o en cualquier sitio web relacionado, debe ser tomada como una indicaci&oacute;n de que todo el contenido ha sido modificado o actualizado.</p>\r\n\r\n<p><strong><em>RESCISI&Oacute;N</em></strong></p>\r\n\r\n<p>Las obligaciones y responsabilidades de las partes que hayan incurrido con anterioridad a la fecha de terminaci&oacute;n sobrevivir&aacute;n a la terminaci&oacute;n de este acuerdo a todos los efectos.</p>\r\n\r\n<p>Estas Condiciones de servicio son efectivos a menos que y hasta que sea finalizado por ti o nosotros. Puedes finalizar cualquier relaci&oacute;n con nosotros en cualquier momento comunic&aacute;ndote directamente al tel&eacute;fono ___________ y se&ntilde;alando que ya no deseas utilizar nuestros servicios.</p>\r\n\r\n<p>Si a nuestro juicio, fallas o se sospecha que has fallado en el cumplimiento de cualquier t&eacute;rmino o disposici&oacute;n de estas condiciones de servicio, tambi&eacute;n podemos terminar este acuerdo en cualquier momento sin previo aviso, y seguir&aacute;s siendo responsable de todos los montos adeudados hasta incluida la fecha de terminaci&oacute;n; y/o en consecuencia podemos negarte el acceso a nuestros servicios (o cualquier parte del mismo).</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong><em>ACUERDO COMPLETO</em></strong></p>\r\n\r\n<p>Nuestra falla para ejercer o hacer valer cualquier derecho o disposici&oacute;n de estas Condiciones de Servicio no constituir&aacute; una renuncia a tal derecho o disposici&oacute;n. Estas Condiciones del servicio y las pol&iacute;ticas o reglas de operaci&oacute;n publicadas por nosotros en este sitio o con respecto al servicio constituyen el acuerdo completo y el entendimiento entre t&uacute; y nosotros y rigen el uso del Servicio y reemplaza cualquier acuerdo, comunicaciones y propuestas anteriores o contempor&aacute;neas, ya sea oral o escrita, entre t&uacute; y nosotros (incluyendo, pero no limitado a, cualquier versi&oacute;n previa de los T&eacute;rminos de Servicio). Cualquier ambig&uuml;edad en la interpretaci&oacute;n de estas Condiciones del servicio no se interpretar&aacute;n en contra del grupo de redacci&oacute;n.</p>\r\n', 'default.jpg', 'legales', '2019-07-15 16:40:12', '2019-07-15 16:40:12', '2019-07-15 16:40:12', 'activo', NULL);
INSERT INTO `publicaciones` (`ID_PUBLICACION`, `PUBLICACION_TITULO`, `PUBLICACION_URL`, `PUBLICACION_RESUMEN`, `PUBLICACION_CONTENIDO`, `PUBLICACION_IMAGEN`, `PUBLICACION_TIPO`, `PUBLICACION_FECHA_REGISTRO`, `PUBLICACION_FECHA_ACTUALIZACION`, `PUBLICACION_FECHA_PUBLICACION`, `PUBLICACION_ESTADO`, `ORDEN`) VALUES
(4, 'Términos y condiciones de servicio para usuarios', 'terminos-y-condiciones-de-servicio-para-usuarios-nil', '        ', '<p>TÉRMINOS\r\nY CONDICIONES DE SERVICIO PARA USUARIOS</p><p>INFORMACIÓN GENERAL</p><p><strong><em><u>USO DEL SERVICIO PARA\r\nUSUARIOS</u></em></strong><em></em></p><p>La empresa Abanico Siempre lo mejor S. A. de C.V., en adelante\r\n“ABANICO” ofrece este sitio web <a href=\"http://www.abanicoytu.com/\">www.abanicoytu.com</a>\r\nen adelante “EL SITIO”. En todo el sitio, los términos “nosotros” y “nuestro”\r\nse refieren a Abanico Siempre lo mejor S.A. de C.V., e incluyen toda la\r\ninformación, herramientas y servicios disponibles para ustedes, LOS USUARIOS, quienes\r\nestán condicionados a aceptar todos los términos, condiciones, políticas y\r\nnotificaciones aquí establecidos para poder tener acceso a EL SITIO y realizar\r\nsus compras. </p><p><strong><em><u>ACEPTACIÓN DE LOS TÉRMINOS DE USO</u></em></strong><u></u></p><p>Al\r\nacceder, navegar y comprar en EL SITIO de ABANICO, EL USUARIO acepta sujetarse\r\na estos Términos y Condiciones sin limitación o condición alguna, incluyendo\r\nlas actualizaciones, modificaciones y adiciones que ABANICO publique. Dada la\r\nnaturaleza de ABANICO, algunos sitios o servicios pueden estar regulados por\r\ntérminos y condiciones adicionales, por lo que sugerimos al público que lea\r\natentamente tales términos en las secciones correspondientes. Los Términos y\r\nCondiciones de Servicio para usuarios aquí expuestos aplican a todos los usuarios\r\ndel sitio, incluyendo, sin limitación, a usuarios que sean navegadores,\r\nproveedores, clientes, comerciantes, y/o colaboradores de contenido.</p><p>Por favor, lea estos\r\nTérminos y Condiciones cuidadosamente ya que al acceder o utilizar cualquier\r\nparte de EL SITIO los está aceptando. Si no está de acuerdo con todos los Términos\r\ny Condiciones de este acuerdo no debería acceder a la página web o usar\r\ncualquiera de los servicios. ABANICO se reserva el derecho de efectuar modificaciones\r\no cambios en estos Términos y Condiciones sin necesidad de notificar\r\npersonalmente al USUARIO y será la última versión la que aplique en todo\r\nmomento al USUARIO dejando sin validez cualquier documento publicado\r\nanteriormente.</p><p><strong><em><u>TÉRMINOS GENERALES</u></em></strong></p><p>Entiendes\r\nque tu contenido (sin incluir la información de tu tarjeta de crédito), puede ser\r\ntransferida sin encriptar e involucrar transmisiones a través de varias redes y\r\ncambios para ajustarse o adaptarse a los requisitos técnicos de conexión de\r\nredes o dispositivos. La información de tarjetas de crédito está siempre\r\nencriptada durante la transferencia a través de las redes.</p><p>Estás de acuerdo con no\r\nreproducir, duplicar, copiar, vender, revender o explotar cualquier parte del\r\nServicio, uso del Servicio, o acceso al Servicio o cualquier contacto en el\r\nsitio web a través del cual se presta el servicio, sin consentimiento por\r\nescrito de nuestra parte. Los títulos utilizados en este acuerdo se incluyen\r\nsolo por conveniencia y no limita o afecta a estos Términos y Condiciones.</p><p><strong><em></em></strong></p><p><strong><em></em></strong></p><p><strong><em><u>RESTRICCIÓN DE EDAD</u></em></strong></p><p>Al utilizar este sitio,\r\ndeclaras que tienes al menos la mayoría de edad en tu estado o lugar de residencia,\r\no nos has hecho llegar la documentación que acredite un permiso por parte de tus\r\npadres, tutores o representante legal para que accedas y hagas uso de EL SITIO.\r\n</p><p><strong><em>REGISTRO</em></strong></p><p>Para\r\nhacer uso de EL SITIO y/o los servicios prestados EL USUARIO podrá:</p><p>a) CREAR UNA CUENTA\r\nregistrándose en la página <a href=\"http://www.abanicoytu.com/\">www.abanicoytu.com</a>\r\ne ingresando la información que se le solicita con datos válidos y verdaderos.\r\nDichos datos deberán de ser actualizados por EL USUARIO cada vez que exista\r\nalgún cambio en la información ingresada con anterioridad. ABANICO podrá requerir\r\nalgún comprobante y/o dato adicional que nos permitan validar la información\r\nbrindada por los USUARIOS sin que esto implique que ABANICO se responsabiliza\r\npor la veracidad de la información que EL USUARIO proporcione, siendo\r\nresponsabilidad absoluta de EL USUARIO garantizar la veracidad, exactitud y\r\nautenticidad de la información. De no poder comprobar la información de EL USUARIO,\r\nABANICO se reserva el derecho de suspender temporal o definitivamente a tales USUARIOS.\r\nEL USUARIO solo podrá ser titular de una cuenta, no pudiendo acceder a más de\r\nuna con diferentes direcciones de correo electrónico o modificando y/o\r\nalterando sus datos personales. Una vez registrado, EL USUARIO generará una\r\ncontraseña de acceso. EL USUARIO será el único responsable de asegurar su\r\ncontraseña y de las actividades que ocurran bajo el uso de la cuenta o contraseña.\r\nEn caso de detectar un mal uso de la cuenta o contraseña EL USUARIO deberá reportarlo\r\ninmediatamente. En ningún caso ABANICO será responsable por pérdidas o daños de\r\ncualquier tipo incurridos como resultado de la falta de cumplimiento de esta\r\ncondición. </p><p>De\r\nllegarse a detectar un uso fraudulento, malintencionado o contrario a estos\r\nTérminos y Condiciones, y un uso de nuestros productos con algún propósito\r\nilegal o no autorizado y/o la violación de cualquier ley jurisdiccional,\r\nABANICO se reserva el derecho de dar por terminada cualquier relación\r\ncomercial, suspender definitivamente las cuentas e incluso colaborar\r\njudicialmente para la persecución de los infractores, sin que esto genere algún\r\nderecho a indemnización o resarcimiento por parte de ABANICO.</p><p>Algunos\r\nservicios presentes en EL SITIO pueden requerir un registro posterior o\r\nsuscripción. En caso de decidir registrarse y/o suscribirse EL USUARIO se\r\ncompromete a brindar información precisa, actualizada y verdadera. </p><p>\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\nb) ACCEDER AL SITIO COMO INVITADO. En este caso\r\nserá posible navegar sin limitaciones en EL SITIO, sin embargo, tendrá que\r\ncrear un registro para poder realizar sus compras.<br></p><p><strong><em>PRIVACIDAD DE LA INFORMACIÓN</em></strong></p><p>ABANICO se compromete en\r\ntodo momento a cumplir las leyes de protección de datos personales aplicables y\r\na los términos de su Aviso de Privacidad el cual puede ser consultado en la\r\ndirección web <a href=\"https://abanicoytu.com/demo/publicacion/aviso-de-privacidad-ok6\">https://abanicoytu.com/demo/publicacion/aviso-de-privacidad-ok6</a>.</p><p> <strong><em></em></strong></p><p><strong><em>PROPIEDAD INTELECTUAL DE ABANICO</em></strong></p><p>Nuestro sitio <a href=\"http://www.abanicoytu.com/\">www.abanicoytu.com</a> está protegido por las\r\nleyes de derecho de autor y propiedad industrial tanto en México como en\r\naquellas zonas donde los tratados internacionales en la materia realizados por\r\nMéxico tengan injerencia. ABANICO tiene la propiedad de los derechos de autor\r\ndel contenido y el software de su sitio web y sus afiliados. Todos los derechos\r\nno otorgados en estos Términos y Condiciones quedan reservados. Queda\r\nabsolutamente prohibido reproducir y/o distribuir cualquier material del sitio\r\nde ABANICO. EL USUARIO puede generar una copia de parte del material publicado\r\nsiempre y cuando sea para uso personal y sin fines comerciales y solo cuando el\r\nmaterial, los avisos y leyendas no sean alterados o modificados en forma\r\nalguna. ABANICO NO otorga ningún permiso para hacer uso del material que se\r\nencuentre en su sitio web.</p><p><strong><em>ACTIVIDADES ILEGALES Y/O PERJUDICIALES</em></strong></p><p>EL USUARIO acepta no realizar ninguna actividad ilegal tales\r\ncomo: 1) utilizar EL SITIO para fines ilícitos; 2) acosar, abusar, insultar,\r\ndañar, difamar, calumniar, desprestigiar, intimidar o discriminar por razones\r\nde género, orientación sexual, religión, etnia, raza, edad, nacionalidad u\r\nhostigar de manera electrónica a otra persona; 3) atentar contra la privacidad\r\nde otras personas; 4) distribuir o transmitir cualquier gusano, virus, código o\r\nprogramas perjudiciales por medio de EL SITIO; 5) introducir publicidad no\r\nautorizada; 6) incluir material obsceno; 7) incluir redireccionamiento o\r\nservidores proxy; 8) interferir, alterar o modificar el funcionamiento, los\r\nservidores o redes conectados a www.abanicoytu.com; 9) ejecutar programas o\r\nconfigurar especialmente equipos de tal manera que mantengan una conexión de\r\nmarcado activa aunque no se use o de cualquier otra forma eludir la desconexión\r\nautomática por inactividad; 10) utilizar EL SITIO en violación de las\r\ndisposiciones de cualquier otro proveedor de sitios web; 11) utilizar EL SITIO para\r\nacceder a las cuentas de otras personas; 12) obtener o eludir las contraseñas\r\nde otras personas, y 13) participar en acciones diseñadas para afectar el\r\nacceso a la red bombardeando un sitio o cualquier red de Internet con tráfico\r\ninútil; 14) solicitarle a terceros que realicen o participen en actos ilícitos;\r\n15) violar cualquier regulación, reglas, leyes internacionales, federales,\r\nprovinciales o estatales, u ordenanzas locales; 16) infringir o violar el\r\nderecho de propiedad intelectual nuestro o de terceras partes; 17) presentar\r\ninformación falsa o engañosa; 18) recopilar o rastrear información personal de\r\notros; 19) para generar spam, phish, pharm, pretext, spider, crawl, o scrape;\r\n19) interferir con o burlar los elementos de seguridad del Servicio. Nos\r\nreservamos el derecho de suspender el uso del Servicio o de cualquier sitio web\r\nrelacionado por violar cualquiera de los incisos de los usos prohibidos.<em></em></p><p><em></em></p><p><strong><em><u>CONDICIONES DE COMPRA</u></em></strong></p><p><strong><em>ENVIO DE PRODUCTOS</em></strong></p><p>Una vez\r\nque se ha recibido la confirmación de la orden de pago comienza a correr el\r\ntiempo de entrega del producto. Al momento de realizarse la entrega del\r\nproducto en el domicilio registrado será necesario que el USUARIO o la persona\r\nque recibe se identifique con un documento oficial (credencial para votar,\r\npasaporte, forma migratoria de ser el caso).</p><p>El USUARIO puede elegir\r\nentre 3 tipos de envío:</p><p>1. \r\nEntrega normal. Con un plazo\r\nde entrega de 3 a 7 días hábiles posteriores a la confirmación de recepción de\r\nla orden.</p><p>2. \r\nEntrega Express. Con un\r\nplazo de entrega de 2 a 5 días hábiles posteriores a la confirmación de\r\nrecepción de la orden.</p><p>3. \r\nEntrega Especial. Con un\r\nplazo de entrega del mismo día hábil hasta el día siguiente posterior a la\r\nconfirmación de la entrega de la orden. Esta entrega requiere que el monto del\r\nproducto haya sido liquidado al momento de hacer el pedido. Las entregas\r\núnicamente se realizarán en direcciones establecidas (casa habitación, oficina\r\no comercio), en ningún caso las entregas se realizarán en lugares públicos. El\r\nárea de cobertura se limita a la Ciudad de México y el Área Metropolitana con\r\nalgunas excepciones. Si la opción de Entrega Especial no se despliega al\r\nmomento de capturar la información correspondiente al método de pago y tipo de\r\nentrega significa que aún no está disponible en el área solicitada. Los\r\nhorarios de entrega son de lunes a viernes de 12:00 am a 7:00 pm de lunes a\r\nviernes y sábado de 10:00 am a 13:00 pm. La entrega se realizará exclusivamente\r\npor personal de ABANICO perfectamente identificado.</p><p>Los\r\ncostos de envío serán mostrados antes de finalizar la compra y el cliente\r\ntendrá la libertad de escoger aquel servicio que mas le convenga en tiempo y\r\nforma. Cuando los productos sean de Abanico o de alguna de las tiendas\r\nasociadas los productos serán enviados de manera conjunta.</p><p>Los\r\nproductos y/o servicios ofertados en nuestra página no incluyen instalación,\r\najustes, configuración ni adaptaciones de ningún tipo, salvo que se explique\r\nclaramente lo contrario. La entrega de los productos se realizará a la entrada\r\ndel domicilio indicado y no incluye ningún tipo de movimiento de mudanza.</p><p>ABANICO puede rechazar o\r\nsuspender el transporte de cualquier producto o mercancía cuando:</p><p>1. \r\nLa información del\r\nremitente y destinatario está incompleta, no sea correcta o que los productos\r\nno correspondan a los registrados para entrega.</p><p>2. \r\nCuando los materiales\r\ncontenidos en el paquete puedan dañar otros paquetes o representen un peligro o\r\nun riesgo para el equipo o empleados de ABANICO o de sus prestadores de\r\nservicios.</p><p>3. \r\nQue el paquete no se\r\nencuentre debidamente embalado para su transporte.</p><p>4. \r\nQue el paquete no incluya\r\nla guía de envío con todos los datos tanto del remitente como del destinatario.\r\n</p><p>5. \r\nQue el peso, volumen y/o\r\napariencia del empaque no coincidan con los descritos en la guía de envío.</p><p>Con el objetivo de verificar lo anterior, ABANICO se reserva el\r\nderecho de inspeccionar todos los paquetes o de permitir a las autoridades\r\ncompetentes llevar a cabo las inspecciones necesarias. En caso de existir\r\nalguna reclamación EL USUARIO deberá presentarla por escrito al correo\r\nelectrónico atencioncliente@abanicoytu.com dentro de los 7 días siguientes a la\r\nentrega del producto. Para que la reclamación proceda todos los cargos\r\nrelacionados con el producto en cuestión deberán de estar completamente liquidados.\r\n</p><p><strong><em>CAMBIOS Y DEVOLUCIONES</em></strong></p><p>Para obtener el cambio de\r\nun producto o la devolución del dinero El USUARIO deberá solicitarlo dentro de\r\nlos primeros 5 días hábiles posteriores a la entrega del producto, siempre y\r\ncuando no se trate de mercancía ilegal, estupefacientes, drogas, pornografía\r\nilegal o cualquier producto que NO se encuentre en la lista de productos\r\npermitidos por las Autoridades Mexicanas para su comercialización en el país.\r\nLos gastos derivados de las devoluciones serán cubiertos por EL USUARIO.</p><p> Los cambios y/o\r\ndevoluciones deberán solicitarse de acuerdo a nuestra política (<a href=\"devoluciones\">Devoluciones</a>).\r\nPara mayor información EL USUARIO puede comunicarse al correo electrónico <a href=\"mailto:devoluciones@abanicoytu.com\">devoluciones@abanicoytu.com</a> dentro\r\nde los primeros 5 días hábiles posteriores a la recepción del producto en\r\ncuestión.</p><p> El(los) producto(s) que sean\r\ndevueltos deberán encontrarse en perfecto estado, con su comprobante original\r\nde compra, el empaque y los instructivos originales. En caso de haber\r\nsolicitado una factura, esta deberá acompañar al producto al momento de ser devuelto.\r\nDe no cumplirse con todos los requisitos ABANICO se reserva el derecho de NO\r\nrealizar la devolución.</p><p>En ningún caso se\r\nrealizarán devoluciones de medias, lencería, bonetería, discos, libros y\r\nrevistas, software, equipos de cómputo, consolas y videojuegos, vinos y\r\nlicores, vestidos de noche, joyería fina y de fantasía, línea blanca, sonido y\r\ntelevisión, gourmet, flores, colchones, reclinables, almohadas, tapetes,\r\nnavideños, perecederos, artículos personalizados y artículos de uso personal.</p><p><em>CANCELACIONES POR PARTE DEL USUARIO</em></p><p>Para poder realizar una cancelación el pedido debe de tener un\r\nestatus de “<strong><em><u>en espera de pago</u></em></strong>”. Si ya hay un estatus diferente a\r\neste, EL USUARIO deberá realizar una devolución una vez recibido el o los\r\nproductos de acuerdo con nuestros Términos y Condiciones, misma que deberá de analizarse\r\npara su resolución. Los costos asociados con la devolución únicamente serán cubiertos\r\npor ABANICO cuando se trate de sus productos. Caso contrario, cada tienda será responsable\r\npor el costo del proceso de devolución. Para poder realizar una cancelación, EL\r\nUSUARIO deberá enviar un correo electrónico a <a href=\"mailto:devoluciones@abanicoytu.com\">devoluciones@abanicoytu.com</a>.</p><p><em>CARGOS NO RECONOCIDOS POR PARTE DEL USUARIO</em></p><p>De\r\nllegarse a presentar un cargo a tarjeta de crédito o débito que no sea\r\nreconocido por EL USUARIO, ABANICO iniciará una averiguación previa apoyándose\r\ndel Ministerio Público y la Institución financiera que corresponda. ABANICO tomará\r\nlas medidas necesarias, dentro del marco de la ley, para recuperar el o los\r\nproductos en caso de haber sido entregados a EL USUARIO.</p><p><strong><em>EXACTITUD, EXHAUSTIVIDAD Y ACTUALIDAD DE LA INFORMACIÓN</em></strong></p><p>A pesar\r\nde que intentamos hacer una revisión exhaustiva de todo el material que ingresa\r\na nuestra página, no nos hacemos responsables si la información disponible en\r\neste sitio no es exacta, completa o actual. El material en este sitio es\r\nprovisto solo para información general y no debe confiarse en ella o utilizarse\r\ncomo la única base para la toma de decisiones sin consultar, primeramente,\r\ninformación más precisa, completa u oportuna. Si existiera alguna duda o\r\ncomentario sugerimos encarecidamente que EL USUARIO se acerque a los vendedores\r\ny/o prestadores de servicios y les externe todas sus dudas antes de adquirir el\r\nproducto o servicio. <del></del>Así mismo, hacemos el esfuerzo de\r\nmostrar las características, colores e imágenes de nuestros productos de la\r\nforma más precisa, sin embargo, nos es imposible garantizar que observes a\r\ntravés de tu monitor o pantalla los colores exactos de los productos que te\r\ninteresan.</p><p>Este sitio puede contener\r\ncierta información histórica la cual es provista únicamente para tu referencia.\r\nABANICO se reserva el derecho de modificar los contenidos de este sitio en\r\ncualquier momento, por lo que invitamos a EL USUARIO a revisar y monitorear la\r\ninformación para detectar cambios que puedan tener injerencia en su compra.</p><p><strong><em>MODIFICACIONES AL SERVICIO Y PRECIOS</em></strong></p><p>Los precios de nuestros\r\nproductos están sujetos a cambio sin previo aviso. De igual modo, nos\r\nreservamos el derecho de modificar o discontinuar el Servicio (o cualquier\r\nparte del contenido) en cualquier momento sin aviso previo. Por lo anterior, no\r\nseremos responsables ante ti o alguna tercera parte por cualquier modificación,\r\ncambio de precio, suspensión o discontinuidad del Servicio.</p><p><strong><em>PRODUCTOS O SERVICIOS</em></strong></p><p>Ciertos\r\nproductos o servicios pueden estar disponibles exclusivamente en línea a través\r\ndel sitio web. Estos productos o servicios pueden tener cantidades limitadas\r\ny/o estar sujetos a devolución o cambio de acuerdo con nuestra política de\r\ndevolución únicamente.</p><p>Nos reservamos el derecho\r\nde limitar las ventas de nuestros productos o servicios a cualquier persona,\r\nregión geográfica o jurisdicción. Este derecho será ejercido dependiendo del caso\r\nen cuestión. Así mismo, nos reservamos el derecho de limitar las cantidades de\r\nlos productos y/o servicios que ofrecemos. Nos reservamos el derecho de discontinuar\r\ncualquier producto en cualquier momento. \r\n</p><p><strong><em>FACTURACIÓN</em></strong></p><p>EL USUARIO puede solicitar\r\nuna factura por su compra al momento de realizarla o dentro de los 5 días\r\nnaturales posteriores a la compra.</p><p><strong><em>EXCLUSIÓN DE GARANTÍAS Y LIMITACIÓN DE RESPONSABILIDAD</em></strong></p><p>No\r\ngarantizamos ni aseguramos que el uso de nuestro servicio será ininterrumpido,\r\npuntual, seguro o libre de errores. No garantizamos que los resultados que se\r\npuedan obtener del uso del servicio serán exactos o confiables. Aceptas que de\r\nmanera ocasional podemos quitar el servicio por períodos indefinidos o cancelar\r\nel servicio en cualquier momento sin previo aviso. Aceptas expresamente que el\r\nuso de, o la posibilidad de utilizar, el servicio es bajo tu propio riesgo. Los\r\nproductos y servicios proporcionados a través del servicio son (salvo lo\r\nexpresamente manifestado por nosotros) proporcionados \"de la forma en que\r\nse presentan\" y \"de acuerdo a su disponibilidad\" para su uso,\r\nsin ningún tipo de representación, garantías o condiciones, ya sea expresa o\r\nimplícita, incluidas todas las garantías o condiciones implícitas de\r\ncomercialización, calidad comercializable, la aptitud para un propósito\r\nparticular, durabilidad, título y no infracción.</p><p>En ningún caso Abanico\r\nSiempre lo mejor S.A. de C.V., nuestros directores, funcionarios, empleados,\r\nafiliados, agentes, contratistas, internos, proveedores o prestadores de\r\nservicios serán responsables por cualquier daño, pérdida, reclamo, o daños\r\ndirectos, indirectos, incidentales, punitivos, especiales o consecuentes de\r\ncualquier tipo, incluyendo, sin limitación, pérdida de beneficios, pérdida de\r\ningresos, pérdida de ahorros, pérdida de datos, costos de reemplazo, o\r\ncualquier daño similar, ya sea basado en contrato, agravio (incluyendo\r\nnegligencia), responsabilidad estricta o de otra manera, como consecuencia del\r\nuso de cualquiera de los servicios o productos adquiridos mediante el servicio,\r\no por cualquier otro reclamo relacionado de alguna manera con el uso del\r\nservicio o cualquier producto, incluyendo pero no limitado, a cualquier error u\r\nomisión en cualquier contenido, o cualquier pérdida o daño de cualquier tipo\r\nincurridos como resultado de la utilización del servicio o cualquier contenido\r\n(o producto) publicado, transmitido, o que se pongan a disposición a través del\r\nservicio, incluso si se avisa de su posibilidad. Debido a que algunos estados o\r\njurisdicciones no permiten la exclusión o la limitación de responsabilidad por\r\ndaños consecuenciales o incidentales, en tales estados o jurisdicciones,\r\nnuestra responsabilidad se limitará en la medida máxima permitida por la ley.</p><p><strong><em>INDEMNIZACIÓN</em></strong></p><p>El USUARIO acepta\r\nindemnizar y mantener indemne a Abanico Siempre lo mejor S.A. de C.V. y\r\nnuestras matrices, subsidiarias, afiliados, socios, funcionarios, directores,\r\nagentes, contratistas, concesionarios, proveedores de servicios,\r\nsubcontratistas, proveedores, internos y empleados, de cualquier reclamo o\r\ndemanda, incluyendo honorarios razonables de abogados, hechos por cualquier\r\ntercero a causa o como resultado de su incumplimiento de las Condiciones de\r\nServicio o de los documentos que incorporan como referencia, o la violación de cualquier\r\nley o de los derechos de un tercero.</p><p><strong><em>COMENTARIOS DE USUARIO, CAPTACIÓN Y\r\nOTROS ENVÍOS</em></strong></p><p>Si, a pedido nuestro, envías ciertas\r\npresentaciones específicas (por ejemplo, la participación en concursos) o sin\r\nun pedido de nuestra parte envías ideas creativas, sugerencias, proposiciones,\r\nplanes, u otros materiales, ya sea en línea, por email, por correo postal, o de\r\notra manera (colectivamente, \'comentarios\'), aceptas que podamos, en cualquier\r\nmomento y sin restricción, editar, copiar, publicar, distribuir, traducir o\r\nutilizar por cualquier medio comentarios que nos hayas enviado. No tenemos ni\r\ntendremos ninguna obligación de mantener ningún comentario confidencialmente,\r\nde pagar compensación por comentarios o de responder a comentarios.</p><p>Nosotros podemos, pero no tenemos\r\nobligación de, monitorear, editar o remover contenido que consideremos sea\r\nilegítimo, ofensivo, amenazante, calumnioso, difamatorio, pornográfico, obsceno\r\nu objetable o viole la propiedad intelectual de cualquiera de las partes o los\r\nTérminos de Servicio.</p><p>Aceptas que tus comentarios no violarán\r\nlos derechos de terceras partes, incluyendo derechos de autor, marca, privacidad,\r\npersonalidad u otros derechos personales o de propiedad. Asimismo, aceptas que\r\ntus comentarios no contienen material difamatorio o ilegal, abusivo u obsceno,\r\no contienen virus informáticos u otro malware que pudiera, de alguna manera,\r\nafectar el funcionamiento del Servicio o de cualquier sitio web relacionado. No\r\npuedes utilizar una dirección de correo electrónico falsa, usar otra identidad\r\nque no sea legítima, o engañar a terceras partes o a nosotros en cuanto al\r\norigen de tus comentarios. Tu eres el único responsable por los comentarios que\r\nhaces y su precisión. No nos hacemos responsables y no asumimos ninguna\r\nobligación con respecto a los comentarios publicados por ti o cualquier tercer\r\nparte.</p><p><strong><em>ERRORES, INEXACTITUDES Y OMISIONES</em></strong></p><p>De vez en cuando puede haber\r\ninformación en nuestro sitio o en el Servicio que contiene errores\r\ntipográficos, inexactitudes u omisiones que puedan estar relacionadas con las\r\ndescripciones de productos, precios, promociones, ofertas, gastos de envío del\r\nproducto, el tiempo de tránsito y la disponibilidad. Nos reservamos el derecho\r\nde corregir los errores, inexactitudes u omisiones y de cambiar o actualizar la\r\ninformación o cancelar pedidos si alguna información en el Servicio o en\r\ncualquier sitio web relacionado es inexacta en cualquier momento sin previo\r\naviso (incluso después de que hayas enviado tu orden).</p><p>No asumimos ninguna obligación de actualizar,\r\ncorregir o aclarar la información en el servicio o en cualquier sitio web\r\nrelacionado, incluyendo, sin limitación, la información de precios, excepto\r\ncuando sea requerido por la ley. Ninguna actualización o fecha de actualización\r\naplicada debe ser tomada para indicar que toda la información en el servicio o\r\nen cualquier sitio web relacionado ha sido modificado o actualizado.</p><p><strong><em>RESCISIÓN</em></strong></p><p>Las obligaciones y responsabilidades de\r\nlas partes que hayan incurrido con anterioridad a la fecha de terminación sobrevivirán\r\na la terminación de este acuerdo a todos los efectos.</p><p>Estas Condiciones de servicio son\r\nefectivos a menos que y hasta que sea terminado por ti o nosotros. Puedes\r\nterminar estos Términos de Servicio en cualquier momento por avisarnos que ya\r\nno deseas utilizar nuestros servicios, o cuando dejes de usar nuestro sitio.</p><p>Si a nuestro juicio, fallas, o se\r\nsospecha que has fallado, en el cumplimiento de cualquier término o disposición\r\nde estos Términos y Condiciones de Servicio, también podemos terminar este\r\nacuerdo en cualquier momento sin previo aviso, y seguirás siendo responsable de\r\ntodos los montos adeudados hasta incluida la fecha de terminación; y/o en\r\nconsecuencia podemos negarte el acceso a nuestros servicios (o cualquier parte\r\ndel mismo).</p><p><strong><em>ACUERDO COMPLETO</em></strong></p><p>Nuestra falla para ejercer o hacer\r\nvaler cualquier derecho o disposición de estos Términos y Condiciones no constituirá una renuncia a tal derecho o\r\ndisposición.</p><p>\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\nEstas Condiciones del servicio y las políticas o\r\nreglas de operación publicadas por nosotros en este sitio o con respecto al\r\nservicio constituyen el acuerdo completo y el entendimiento entre tú y nosotros\r\ny rigen el uso del servicio y reemplaza cualquier acuerdo, comunicaciones y propuestas\r\nanteriores o contemporáneas, ya sea oral o escrita, entre tú y nosotros (incluyendo,\r\npero no limitado a, cualquier versión previa de los Términos y Condiciones).<br></p>', 'default.jpg', 'legales', '2019-05-24 21:12:27', '2019-05-24 21:12:27', '2019-05-24 21:12:27', 'activo', NULL),
(5, 'Devoluciones', 'devoluciones', ' ', '<p><strong><em><u>DEVOLUCIONES</u></em></strong></p>\r\n\r\n<p><strong>Generalidades</strong></p>\r\n\r\n<p><strong> </strong>A continuación,\r\nse describen los procesos y condiciones para hacer efectiva la garantía de un\r\nproducto o solicitar un cambio o devolución. Solo se podrán comenzar estos\r\nprocesos una vez que el producto se encuentre en manos de EL COMPRADOR. Los\r\nproductos pueden tener diferentes políticas de devolución de acuerdo a LA TIENDA\r\nque lo esté ofertando, por lo que pedimos atentamente que EL COMPRADOR revise\r\nlas políticas propias de cada tienda. Al realizar una devolución debes tener en\r\ncuenta que el reembolso y la forma en que se realizará pueden variar de acuerdo\r\na la condición del artículo, el tiempo que haya estado en tu poder y la forma\r\nen la que fue adquirido. Cuando el producto devuelto no se encuentra en sus\r\ncondiciones originales, ha sido usado o es diferente al que se envió NO SERA\r\nPOSIBLE PROCESAR EL REEMBOLSO. </p>\r\n\r\n\r\n\r\n<p><strong><em><u>GARANTÍA </u></em></strong></p>\r\n\r\n<p>Para hacer válida la garantía de los artículos adquiridos a través de nuestra\r\npágina <a href=\"http://www.abanicoytu.com/\">www.ABANICOytu.com</a>\r\nel comprador tendrá dos opciones:</p>\r\n\r\n\r\n\r\n<p>1. \r\nSi los artículos pertenecen a la marca ABANICO, el cliente deberá presentar\r\nel correo de verificación de compra enviado por ABANICO, contar con la remisión\r\no factura en donde se encuentre escrita la garantía o la póliza del proveedor o\r\nfabricante, donde este claramente establecido el tipo y tiempo de garantía del\r\nproducto. ABANICO actuará como intermediario ante el proveedor o fabricante\r\nquienes son los únicos responsables de hacer válida la garantía de sus productos.\r\n </p>\r\n\r\n<p>En caso de que el producto dañado no pueda ser reparado, reemplazado, se\r\nencuentre agotado o descontinuado por el fabricante, ABANICO ofrecerá alternativas\r\nde productos de la misma categoría y valor del producto original o un reembolso.\r\nEl tiempo de respuesta a la reclamación de la garantía será de 15 días hábiles\r\nuna vez que hayamos recibido toda la documentación necesaria para realizar el trámite.\r\n</p>\r\n\r\n\r\n\r\n<p>2. \r\nCuando los productos pertenezcan a tiendas asociadas a ABANICO, el\r\ncomprador deberá de ponerse directamente en contacto con las tiendas para hacer\r\nválida la garantía de los productos bajo los términos que las propias tiendas\r\nhayan especificado. Los vendedores asociados a ABANICO son los únicos\r\nresponsables del envío de la factura y de la garantía de sus productos. Los gastos\r\nasociados con el traslado del producto correrán a cargo del vendedor o la\r\ntienda. </p>\r\n\r\n \r\n\r\n<p>En ambos casos, el cliente cuenta con 5\r\ndías naturales a partir de la recepción del producto para comunicarse con ABANICO,\r\nLA TIENDA o EL VENDEDOR para reportar cualquier anomalía o malfuncionamiento\r\ndel producto. Se deberá presentar en todos los casos la documentación de pago y\r\ngarantía del producto en cuestión. La validez de la garantía dependerá de las\r\nespecificaciones mencionadas en la descripción de cada producto de acuerdo a\r\ncada proveedor o marca.</p>\r\n\r\n<p> Si\r\nel malfuncionamiento del producto o desperfecto se debe a un uso incorrecto o\r\ndesconocimiento por parte del comprador la garantía queda anulada de forma\r\ninmediata.</p>\r\n\r\n<p> En\r\ntodos los casos los clientes deben de leer cuidadosamente las condiciones de\r\nlas pólizas de garantía ya que <strong>NI</strong> ABANICO,\r\nLAS TIENDAS o LOS VENDEDORES podrán hacerse cargo de reclamaciones que hayan\r\nsido ocasionadas por causas ajenas a la operación del producto, tales como\r\ncambios bruscos de voltaje, utilización de accesorios inadecuados o no\r\nrecomendados por los fabricantes, derrames de líquidos, fuego, abuso en el\r\nmanejo del producto, desgaste natural de algunos materiales en la composición\r\ndel producto. No se responde por software incluido en los equipos de computación,\r\nerrores de configuración de ningún tipo, daños causados por virus,\r\nincompatibilidad o incumplimiento de las condiciones mínimas de uso de algún\r\nsoftware específico. La garantía que ofrece la Tienda o el fabricante no será\r\naplicable en ningún caso por incompatibilidad con algún software y/o hardware.</p>\r\n\r\n<p>Estas políticas no son excluyentes ni\r\ndeben ser entendidas o utilizadas en contraposición a las condiciones de\r\ngarantía que maneje cada proveedor.</p>\r\n\r\n\r\n\r\n<p><strong><em><u>DEVOLUCIONES</u></em></strong><em><u></u></em></p>\r\n\r\n<p>Solo se podrá iniciar una solicitud de devolución\r\ncuando el bien adquirido se encuentre dañado, roto, no funcione de manera\r\nadecuado (siempre y cuando esta condición no haya sido indicada en la descripción\r\no características del producto), o este no cumpla con la descripción que fue\r\npublicada. No se incluyen aquellos casos en los que el producto haya sido\r\nextraviado, robado o dañado por el servicio de paquetería o transportista. La única\r\nexcepción será cuando los productos sean entregados por medio del servicio exprés\r\nde ABANICO. </p>\r\n\r\n<p>Para iniciar una solicitud de devolución\r\nEL COMPRADOR deberá contactar al área de atención a clientes al correo <a href=\"mailto:atencioncliente@abanicoytu.com\">atencioncliente@abanicoytu.com</a>\r\nindicando de manera detallada los motivos por los que se solicita la devolución.\r\nUna vez iniciado el proceso de devolución la solicitud será evaluada por\r\nnuestro personal siguiendo los lineamientos establecidos en nuestra política de\r\ndevoluciones. </p>\r\n\r\n<p>Al aceptarse la devolución EL COMPRADOR\r\ndeberá enviar el producto a ABANICO cuando los productos pertenezcan a esta\r\ntienda, o directamente AL VENDEDOR del que adquirió el bien. En ambos casos,\r\nlos gastos derivados del traslado del producto correrán a cargo de ABANICO o de\r\nLA TIENDA responsable del mismo. </p>\r\n\r\n<p>Los productos que sean devueltos deberán\r\nestar acompañados por el comprobante original de la compra y, en su caso, la\r\nfactura que la tienda hubiere emitido. El tiempo de respuesta de la solicitud\r\nde devolución dependerá del producto en cuestión. </p>\r\n\r\n\r\n\r\n<p>El comprador podrá optar por los siguientes tipos de devolución:</p>\r\n\r\n<p><strong>Reembolso a tarjeta de crédito o débito</strong>: El Comprador podrá solicitar el abono\r\ndel importe del producto devuelto, a la tarjeta de crédito o débito con la que\r\nse haya pagado dicho producto. Con un tiempo estimado para que el monto se vea\r\nreflejado en su tarjeta de hasta 15 días naturales posteriores a su aceptación.\r\n</p>\r\n\r\n<p><strong>Transferencia bancaria:</strong>El Comprador podrá solicitar la\r\ndevolución mediante transferencia bancaria por el total de la compra. Con un\r\ntiempo estimado para que la transferencia se vea reflejada de 5 días hábiles. </p>\r\n\r\n<p>Si el reembolso no aparece y el tiempo de procesamiento para tu\r\nmétodo de pago ha pasado, por favor comunícate con nosotros. </p>\r\n\r\n\r\n\r\n<p><strong><em><u>CAMBIOS</u></em></strong><em><u></u></em></p>\r\n\r\n<p>EL COMPRADOR deberá contactar al área\r\nde atención a clientes enviando un correo a <a href=\"mailto:atencionclientes@abanicoytu.com\">atencionclientes@abanicoytu.com</a>\r\npara iniciar su solicitud de cambio físico de la mercancía cuando el producto se\r\nencuentre dañado, roto o no funcione de manera adecuada. En ningún caso se realizarán\r\ncambios de productos enlistados en <strong>“Restricciones\r\nde cambio y/o devolución”</strong>. Al momento de contactarse con ABANICO, EL\r\nCOMPRADOR deberá indicar la razón por la cual solicita un cambio físico y las\r\nespecificaciones del producto a cambiar. </p>\r\n\r\n<p>Una vez contactados con ABANICO se le indicará\r\na EL COMPRADOR la forma en que se llevará a cabo la devolución del producto. Los\r\nproductos que sean enviados de vuelta deberán de estar en su empaque original,\r\nacompañados por la documentación con que fue entregado, el recibo emitido por ABANICO\r\no LA TIENDA y, en su caso, la factura de compra que fue elaborada. Una vez\r\nrecibido el producto se procederá a evaluarlo y se notificará a EL COMPRADOR\r\ndentro de los 15 días hábiles posteriores a la recepción del producto si la solicitud\r\nde cambio procede o no. Cuando el cambio se solicite por algún motivo\r\natribuible a ABANICO o a LA TIENDA el envío se realizara sin costo para EL\r\nCOMPRADOR. Si el cambio es atribuible a EL COMPRADOR, este será responsable de\r\nasumir todos los gastos del proceso. </p>\r\n\r\n\r\n\r\n<p><strong>Información necesaria para cualquier proceso de cambio y/o devolución:</strong></p>\r\n\r\n<p>Para solicitar un proceso de cambio y/o\r\ndevolución EL COMPRADOR deberá enviar a <a href=\"mailto:atencioncliente@abanicoytu.com\">atencioncliente@abanicoytu.com</a>\r\nla siguiente documentación:</p><p><ul><li>\r\n\r\nNúmero\r\n de pedido con el que se compró el producto.</li><li>Fechas\r\n en la que se realizó la compra.</li><li>Fecha\r\n en que se recibió el producto.</li><li>Descripción\r\n del artículo.</li><li>Motivo\r\n y razones por las que se solicita la devolución o cambio.</li></ul></p>\r\n\r\n\r\n\r\n<p>Es posible que ABANICO o LA TIENDA\r\nsoliciten pruebas de la condición en la que fue recibido el producto, como fotografías.\r\n</p>\r\n\r\n<p>Los productos devueltos a ABANICO o LA\r\nTIENDA, deberán estar en las mismas condiciones en las que fueron recibidos,\r\nincluir todas las partes, accesorios y empaque original. No debe observarse\r\ndaño alguno en el producto.</p>\r\n\r\n<p>El tiempo para recibir los productos\r\nque sustituyan a la compra original podrán variar de acuerdo a la disponibilidad,\r\ntiempo de respuesta de los proveedores y los tiempos de la mensajería. </p>\r\n\r\n \r\n\r\n<p>Los <strong>COSTOS DE ENVIO</strong> asociados\r\nal cambio o devolución de los productos <strong>serán\r\ncubiertos</strong> de la siguiente manera:</p>\r\n\r\n\r\n\r\n<p>1. Cuando el producto este incompleto, la tienda correrá con los gastos.</p>\r\n\r\n<p>2. Cuando el daño del producto haya sido causado por un mal manejo de la\r\nmensajería, esta correrá con los gastos. </p>\r\n\r\n<p>3. Cuando el daño sea causado por un embalaje inadecuado, LA TIENDA o ABANICO\r\ncubrirán los gastos.</p>\r\n\r\n<p>4. cuando el producto no cumpla con las especificaciones marcadas en el\r\nanuncio, LA TIENDA cubrirá los gastos. </p>\r\n\r\n\r\n\r\n<p><strong><em><u>RESTRICCIONES DE\r\nCAMBIO Y/O DEVOLUCIÓN</u></em></strong><em><u></u></em></p>\r\n\r\n<p>Los relojes con valor superior a los $1150.00,\r\ncomputadoras, televisores, proyectores y celulares estarán respaldados por la garantía\r\ndel fabricante. </p>\r\n\r\n<p>Muebles que no requieren ensamblaje. Todos los materiales de uso y soporte\r\ndel producto (manuales, tarjetas de garantía, etc.) deberán ser devueltos con\r\nel artículo. No es necesario que presenten su envoltura original para\r\ndevolverlos. </p>\r\n\r\n<p>Muebles que requieren ensamblaje. Todos los materiales de uso y soporte\r\ndel producto (incluyendo herramientas, manuales, tarjetas de garantía, etc.)\r\ndeben ser devueltos con el artículo. El producto a devolverse debe estar\r\ndesensamblado y dentro de su empaque original.</p>\r\n\r\n<p>Equipo de gimnasio.<strong></strong>Todos los materiales de uso y soporte del\r\nproducto (incluyendo herramientas, manuales, tarjetas de garantía, etc.)\r\ndeberán ser devueltos con el artículo. El producto a devolverse debe estar\r\ndesensamblado y dentro de su empaque original.</p>\r\n\r\n<p>Los productos de línea blanca podrán ser\r\ndevueltos siempre y cuando la instalación y desinstalación hayan sido\r\nrealizadas por personal autorizado por el fabricante. </p>\r\n\r\n<p>En caso de solicitar una devolución o\r\ncambio en productos hechos a mano y/o personalizados EL COMPRADOR deberá contactar\r\ndirectamente al vendedor externo, quien no esta obligado a recibir la reclamación\r\na menos que los productos presenten daño o defectos al ser recibidos o si existe\r\nun error tipográfico o de configuración debido a un error del vendedor. En\r\nestos casos, el producto debe de ser devuelto en su empaque original e incluir,\r\nsi aplica, certificados de autenticidad, avalúo, etc. Caso contrario, no se aceptará\r\nla devolución de los productos. </p>\r\n\r\n\r\n\r\n<p>NO SE ACEPTARÁN CAMBIOS NI DEVOLUCIONES EN LOS SIGUIENTES PRODUCTOS:</p>\r\n\r\n<p><ul><li>Alimentos y bebidas</li><li>Artículos de limpieza para lentes,\r\ncámaras, celulares, zapatos.</li><li>Artículos de uso personal como\r\nrastrillos, rasuradoras, navajas, etc. </li><li>Artículos funerarios y velas</li><li>Artículos perecederos</li><li>Audífonos</li><li>Bisutería y joyería</li><li>Chocolates</li><li>Colchones y artículos de cama\r\n(almohadas, fundas, cubrecamas)</li><li>Consumibles</li><li>Cosméticos y perfumes (sólo si el\r\nproducto está sellado)</li><li>Cualquier producto que no tenga el\r\nnúmero de serie o el código universal de producto (UPC)</li><li>Despensa, vinos y gourmet</li><li>Disfraces (sólo aplica por cambio de\r\ntalla)</li><li>Dispositivos médicos</li><li>Flores</li><li>Juguetes sexuales</li><li>Lápices, colores, bolígrafos</li><li>Laptops y computadoras de escritorio</li><li>Lencería, ropa interior y ropa de baño</li><li>Libros (sólo en casos de error de\r\nimpresión)</li><li>Manos libres</li><li>Máquinas de coser</li><li>Medicamentos, vitaminas, suplementos alimenticios\r\ny productos naturales</li><li>Mercancía dañada y/o desgastada por el\r\nuso común.</li><li>Modeladores / fajas / leggins / pantimedias</li><li>Películas</li><li>Preservativos y anticonceptivos</li><li>Productos de copia inmediata (revistas,\r\nCD, DVD, Blu-ray, software, videojuegos)</li><li>Productos de farmacia, de incontinencia\r\ne higiene personal</li><li>Productos de lactancia y Cuidado para\r\nbebés</li><li>Productos de salud y cuidado personal</li><li>Productos o servicios de computación</li><li>Productos para afeitado y depilación</li><li>Productos que están clasificados como\r\nmateriales peligrosos o que usen líquidos inflamables o combustibles</li><li>Productos que no se encuentren en el catálogo\r\nde ABANICO o LA TIENDA pero que han sido realizados a solicitud del cliente</li><li>Refacciones, repuestos y autopartes</li><li>Relojes,</li><li>Shampoo y artículos para el cuidado de\r\nOjos, Labios, Boca u Oídos</li><li>Software abierto</li><li>Tarjetas de memoria para PC</li><li>Tarjetas de regalo (excepto en casos\r\nrequeridos por ley)</li><li>Tarjetas SIM de telefonía para\r\ncelulares</li><li>Tarjetas telefónicas</li><li>Test de salud, genéticos, etc. </li><li>Tiempo aire</li><li>Toallas y calcetines</li><li>Video juegos</li></ul></p>\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n<p><strong><em><u>CANCELACIONES</u></em></strong></p>\r\n\r\n<p> La compra solo puede\r\nser cancelada por EL COMPRADOR cuando el envío se encuentre en un estatus “en\r\nespera de pago”. Si el estatus es diferente deberá de procederse a solicitar\r\nuna devolución. </p>\r\n\r\n<p> Si la compra es cancelada\r\npor LA TIENDA, EL VENDEDOR o ABANICO se generará un cupón que EL COMPRADOR podrá\r\nhacer efectivo inmediatamente en la página. Si el comprador no desea el cupón podrá\r\nsolicitar un reembolso acorde a la forma de pago utilizada enviando un correo a\r\n<a href=\"mailto:atencionclientes@abanicoytu.com\">atencionclientes@ABANICOytu.com</a>.\r\nLos reembolsos se realizarán únicamente a la tarjeta de crédito o debido que\r\nfue utilizada para realizar la compra. Cuando la compra se realizó a través de PAYPAL\r\nel reembolso se realizará directamente a tu cuenta y posteriormente será PayPal\r\nquien sea responsable de reintegrar el importe a la tarjeta con la que se\r\nrealizo la compra. En el caso de depósitos bancarios o pagos en tiendas OXXO\r\nnos comunicaremos contigo para solicitar información necesaria para poder\r\ndepositar el monto. El reembolso se realizará dentro de las siguientes 48 horas\r\na la solicitud y le será informado a través de un correo electrónico, sin\r\nembargo, el tiempo que tarde en verse reflejado en las cuentas personales dependerá\r\nde los tiempos que manejen los diferentes bancos los cuales pueden tomar entre\r\n4 a 23 días. </p>\r\n\r\n', 'default.jpg', 'legales', '2019-04-03 23:22:26', '2019-04-03 23:22:26', '2019-04-03 23:22:26', 'activo', NULL),
