            <div class=\"carousel-item\">\r\n              <img class=\"d-block w-100\" src=\"../assets/global/img/flujos/flujo7.5.png\" alt=\"Registro paso 5\">\r\n            </div>\r\n            <div class=\"carousel-item\">\r\n              <img class=\"d-block w-100\" src=\"../assets/global/img/flujos/flujo7.6.png\" alt=\"Registro paso 6\">\r\n            </div>\r\n            <div class=\"carousel-item\">\r\n              <img class=\"d-block w-100\" src=\"../assets/global/img/flujos/flujo7.7.png\" alt=\"Registro paso 7\">\r\n            </div>\r\n            <div class=\"carousel-item\">\r\n              <img class=\"d-block w-100\" src=\"../assets/global/img/flujos/flujo7.8.png\" alt=\"Registro paso 8\">\r\n            </div>\r\n            <div class=\"carousel-item\">\r\n              <img class=\"d-block w-100\" src=\"../assets/global/img/flujos/flujo7.9.png\" alt=\"Registro paso 9\">\r\n            </div>\r\n            <div class=\"carousel-item\">\r\n              <img class=\"d-block w-100\" src=\"../assets/global/img/flujos/flujo7.10.png\" alt=\"Registro paso 10\">\r\n            </div>\r\n            <div class=\"carousel-item\">\r\n              <img class=\"d-block w-100\" src=\"../assets/global/img/flujos/flujo7.11.png\" alt=\"Registro paso 11\">\r\n            </div>\r\n            <div class=\"carousel-item\">\r\n              <img class=\"d-block w-100\" src=\"../assets/global/img/flujos/flujo7.12.png\" alt=\"Registro paso 12\">\r\n            </div>\r\n          </div>\r\n          <a class=\"carousel-control-prev\" href=\"#carouselAyuda\" role=\"button\" data-slide=\"prev\">\r\n            <span class=\"carousel-control-prev-icon\" aria-hidden=\"true\"></span>\r\n            <span class=\"sr-only\">Previous</span>\r\n          </a>\r\n          <a class=\"carousel-control-next\" href=\"#carouselAyuda\" role=\"button\" data-slide=\"next\">\r\n            <span class=\"carousel-control-next-icon\" aria-hidden=\"true\"></span>\r\n            <