(1, '5ca4043cde1435.48493149', 'P RP', 'Traducción de textos Inglés-español-inglés', 'Si tienes que traducir un texto no te preocupes, yo lo hago por ti. Me especializo en textos científicos y en resúmenes para congresos, tesis o simposios. ', '', 'México', '-', '-', 'En todo México ', 'default.jpg', 'default.jpg', 0, '0.00', '2019-04-04 00:47:18', '2019-07-08 20:44:27', '2019-04-04 00:47:18', 'digital', 'es', 'inactivo', 1),
