(3, '5d028e2fe75594.20009715', 'Mario LUNA', 'Asesoría y apoyo en la elaboración de tesis y trabajos recepcionales', 'Asesoría en la elaboración de tesis, redacción, diseño de instrumentos de investigación de campo y análisis de resutados', 'Apoyo en la elaboración del protocolo de investigación, revisión y redacción en el marco teórico, apoyo en el diseño de instrumento de investigación, análisis de datos y desarrollo de la discusión', 'México', 'Veracruz', 'Xalapa', '', 'default.jpg', 'default.jpg', 0, '0.00', '2019-06-15 19:10:57', '2019-07-08 20:44:21', '2019-06-15 19:10:57', 'digital', 'es', 'inactivo', 1),
(4, '5ca4043cde1435.48493149', 'P RP', 'Instalacion de sistemas de filtracion de agua. ', 'Se instalan sistemas de filtración domésticos arriba y abajo del fregadero. Tambien instalamos sistemas de osmosis inversa y de cartuchos multiples. ', '', 'México', 'Ciudad de México', 'Benito Juárez', 'Damos servicio en toda la Ciudad. ', 'default.jpg', 'default.jpg', 0, '0.00', '2019-06-17 22:27:16', '2019-07-08 20:44:18', '2019-06-17 22:27:16', 'profesional', 'es', 'inactivo', 1),
(5, '5d0ab3549fe593.01622310', 'Margarita Pliego', 'Demostración e instalación de equipos para filtración de agua.', 'Te explicamos como funcionan los diferentes sistemas de filtracion de agua y si te interesa adquirir uno o ya tienes el tuyo, nosotros te lo instalamos.', 'Te mostramos cual es el funcionamiento de los diferentes tipos de filtros de agua y te aconsejamospara que encuentres el mas adecuado para ti. Si ya tienes el tuyo, nosotros podemos encargarnos de su instalación y/o mantenimiento.', 'México', 'Ciudad de México', 'Gustavo A. Madero', 'Toda la Ciudad de México.', 'default.jpg', 'default.jpg', 0, '0.00', '2019-06-19 23:56:16', '2019-07-08 20:44:13', '2019-06-19 23:56:16', 'profesional', 'es', 'inactivo', 1),
(6, '5c0653d43d92e7.75019474', 'Manuel Marmolejo Martínez', 'Diseño Gráfico', 'Flyers lonas ', '', 'México', 'Ciudad de México', 'Gustavo A. Madero', 'En todo México, servicio por internet', 'default.jpg', 'default.jpg', 0, '0.00', '2019-06-20 22:02:16', '2019-06-20 22:02:16', '2019-06-20 22:02:16', 'digital', 'es', 'activo', 1),
(7, '5d126bcf19c1a6.18130926', 'Penelope Rodriguez ', 'Clases de tejido', 'Charlemos y tejamos hermosas creaciones. Te envio las instrucciones para esos proyectos de tejido que siempre quisiste hacer y por videoconferencia revisamos las dudas y los avances.', '', 'México', '-', '-', 'Todo el país ', 'default.jpg', 'default.jpg', 0, '0.00', '2019-06-25 23:59:41', '2019-06-26 21:10:33', '2019-06-25 23:59:41', 'digital', 'es', 'activo', 1);
